INSERT INTO `sb_page` VALUES(1, '0', 'Orientation', '<object classid=\\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\\" codebase=\\"http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0\\" width=\\"395\\" height=\\"370\\" id=\\"audios\\" align=\\"middle\\">\r\n<param name=\\"allowScriptAccess\\" value=\\"sameDomain\\" />\r\n<param name=\\"movie\\" value=\\"images/audios.swf\\" /><param name=\\"quality\\" value=\\"high\\" /><param name=\\"bgcolor\\" value=\\"#ffffff\\" /><embed src=\\"images/audios.swf\\" quality=\\"high\\" bgcolor=\\"#ffffff\\" width=\\"395\\" height=\\"370\\" name=\\"audios\\" align=\\"middle\\" allowScriptAccess=\\"sameDomain\\" type=\\"application/x-shockwave-flash\\" pluginspage=\\"http://www.macromedia.com/go/getflashplayer\\" />\r\n</object>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You can review this <a href=\\"#\\" onClick=\\"document.audios.SetVariable(''restart'', ''xx'');\\">Orientation</a> here</p>\r\n<p>Description of audio <a href=''page.php?pageid=177''>here</a></p>\r\n<p>&nbsp;</p>\r\n<p align="center"><strong>Let&rsquo;s get started. </strong></p>\r\n\r\n\r\n<p><strong>Go ahead and click the START button to begin.</strong></p>', NULL, NULL),
(2, '1', 'Chapter 1: Federal Employees'' Compensation Act (FECA)', '\r\n<P >&nbsp;</P>\r\n<p>Many federal employees do not recognize the workers?  compensation program as a benefit of federal employment, <strong>but it is!</strong> </p>\r\n<p>The program should be mentioned when new employees are  oriented as they join the judiciary. </p>\r\n\r\n<P >&nbsp;</P>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Click the Next button to continue.</p>', NULL, NULL),
(3, '1.1', 'Overview', '<P>&nbsp;</P>\r\n<P>Unlike several other federal employee benefits, an employee is eligible immediately for compensation benefits on his or her first day of work for the judiciary.</P>\r\n<P>&nbsp;</P>\r\n<P>The program costs nothing to the employee and does not require him or her to fill out an enrollment form in order to be covered.&nbsp; Moreover, all judiciary employees are covered immediately by the FECA, regardless of whether they are permanent or temporary, full-time or part-time.</P>', NULL, NULL),
(4, '1.2', 'Purpose', '<P><B></B>&nbsp;</P>\r\n<P><B>Purpose</B></P>\r\n<P>&nbsp;</P>\r\n<P>The purpose of the FECA is to provide compensation benefits to federal employees of the United States for disability due to personal injury or disease sustained while in the performance of duty.&nbsp; It also provides for the payment of benefits to dependents if a work-related injury or disease causes an employee?s death.</P>', NULL, NULL),
(5, '1.3', 'Information  Protection', '<P><B></B>&nbsp;</P>\r\n<P><B>Information Protection</B></P>\r\n<P>&nbsp;</P>\r\n<P>Individual case files are protected under the Privacy Act, and only the employee, his or her representative (if any) and court unit personnel may routinely have access to the file.&nbsp; Any of these parties may inspect the file at the district office of the Department of Labor which has custody of the file.</P>', NULL, NULL),
(6, '1.4', 'Types of Benefits', '<P><B></B>&nbsp;</P>\r\n<P><B>Types of Benefits</B></P>\r\n<P><STRONG></STRONG>&nbsp;</P>\r\n<P>The FECA provides two types of benefits to an employee who is injured on the job, if a claim is properly filed and accepted:</P>\r\n<P>&nbsp;</P>\r\n<OL>\r\n<LI>FECA pays medical bills resulting from the injury. \r\n<LI>FECA provides a source of income when an employee is unable to work due to the injury. </LI></OL>', NULL, NULL),
(7, '1.5', 'Source of Financing', '<P><B></B>&nbsp;</P>\r\n<P><B>Source of Financing</B></P>\r\n<P>&nbsp;</P>\r\n<P>The FECA program is financed by the Employees? Compensation Fund, which consists of funds appropriated by Congress directly or indirectly through a chargeback system to the various federal agencies.&nbsp;&nbsp; Each year the Secretary of Labor furnishes each agency with a statement of payments made from the fund with respect to its employees.&nbsp; The agencies include these amounts in their budget requests.&nbsp; </P>', NULL, NULL),
(8, '1.6', 'Eligibility', '<P><B></B>&nbsp;</P>\r\n<P><B>Eligibility</B></P>\r\n<P>&nbsp;</P>\r\n<P>Employees are eligible for coverage by FECA:</P>\r\n<UL>\r\n<LI>while they work, regardless of location. </LI> \r\n<LI>while on federal property. </LI> \r\n<LI>while on official travel. </LI>\r\n<LI>while taking mandatory physical fitness training. </LI></UL>', NULL, NULL),
(9, '1.7', 'Five Requirements for FECA', '\r\n<p>&nbsp;</p>\r\n<p><STRONG>Let?s look at the five requirements for FECA. Here are the first three:</STRONG></p>\r\n<p>&nbsp;</p>\r\n<OL>\r\n<LI>Time<U></U><BR>Injuries after September 7, 1974, claim for compensation filed within three years of date of injury or death. In an occupational disease time begins to run when employee becomes aware of a relationship between condition and job or when last exposed. \r\n<LI>Civil Employee<BR>All civilian employees including Peace Corps, Job Corps, Youth Conservation Corps enrollees, Federal petit or grand jurors and volunteer members of the Civil Air Patrol \r\n<LI>Fact Of Injury<BR>\r\n<p><strong><a href="#" onmouseover="getObj(''r1'').innerHTML = ''Did employee  experience the event, accident or employee factor alleged?'';" onmouseout="getObj(''r1'').innerHTML = '''';">a. Occurrence of event.</a></strong><div id="r1"></div><br />\r\n    <strong><a href="#" onmouseover="getObj(''r2'').innerHTML = ''Did the accident or  employment factor result in an injury or disease?'';" onmouseout="getObj(''r2'').innerHTML = '''';">b. Medical condition.</a></strong><div id="r2"></div></p></LI></OL>\r\n', NULL, NULL),
(10, '1.8', 'Five Requirements for FECA', '\r\n<p>&nbsp;</p>\r\n<p><strong>Here&rsquo;s the fourth requirement:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>4. Performance of Duty (POD)</p>\r\n<p>An injury is said to have occurred in POD if the injury  arose:<u></u></p>\r\n\r\n    <p><strong>a. <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''ra'').innerHTML = ''Injury occurred while carrying out duties for which he or she was hired.'';\\" onmouseout=\\"getObj(''ra'').innerHTML = '''';\\">During the course  of employment</a></strong> <div id=\\"ra\\"></div></p>\r\n    <p><strong>b. <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''rb'').innerHTML = ''Incident related to some aspects or circumstance of the employment, not personal non-work circumstances.'';\\" onmouseout=\\"getObj(''rb'').innerHTML = '''';\\">Out of the  employment</a></strong> <div id=\\"rb\\"></div></p>\r\n<p>One of the following conditions must apply:</p>\r\n    <p><strong>a. <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''r1'').innerHTML = ''Injury occurred in facilities for employee&prime;s health, comfort, convenience for  eating meals, areas immediately outside the building (steps and sidewalks).'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\">Industrial  Premises Rule</a>:</strong> <div id=\\"r1\\"></div></p>\r\n    <p><strong>b. <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''r2'').innerHTML = ''If owned, controlled or maintained by agency, employee will be covered if  injured.'';\\" onmouseout=\\"getObj(''r2'').innerHTML = '''';\\">Parking Garage</a>:</strong> <div id=\\"r2\\"></div></p>\r\n    <p><strong>c. <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''r3'').innerHTML = ''Injuries considered POD if:<ol type=i><li>rule not stringently enforced.<br /></li><li>no warnings given.<br /></li><li>employee unintentionally negligent.</li></ol>'';\\" onmouseout=\\"getObj(''r3'').innerHTML = '''';\\">Violation of  Safety Rule</a>:</strong> <div id=\\"r3\\"></div>\r\n    </p>\r\n    <p><strong>d. <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''r4'').innerHTML = ''Injuries not considered POD if:<br /><ol type=i><li>rule is  stringently enforced.</li><li>employee had frequent (3 or  more) warnings.</li><li>employee intentionally or deliberately negligent  (refusing to wear safety equipment).</li></ol>'';\\" onmouseout=\\"getObj(''r4'').innerHTML = '''';\\">Violation of  Safety Rule</a>:</strong> <div id=\\"r4\\"></div></p>', NULL, NULL),
(11, '1.9', 'Five Requirements for FECA', '<P>&nbsp;</P>\r\n<P><STRONG>Here?s the fifth and last requirement:</STRONG></P>\r\n<P>&nbsp;</P>\r\n<P>5. Causal Relationship</P>\r\n<P>Primarily a medical issue. Involves the establishment of a connection between the injury and condition found as based on medical evidence.</P>\r\n<P><STRONG>A. Direct Causation </STRONG><BR><STRONG>B. Aggravation</STRONG><BR><STRONG>C. Acceleration</STRONG><BR><STRONG>D. Precipitation</STRONG></P>', NULL, NULL),
(18, '1.9.a', 'Quiz', '\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\">Congratulations!<span style=\\"\\">&nbsp; </span>You have completed Chapter 1.<o:p></o:p></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\"><o:p>&nbsp;</o:p></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\">To review what you\r\nhave learned, let?s try a few quick questions.<o:p></o:p></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\"><o:p>&nbsp;</o:p></b></p>\r\n\r\n', NULL, NULL),
(19, '1.9.b', 'Quiz', '', NULL, NULL),
(20, '1.9.c', 'Quiz', '', NULL, NULL),
(21, '2', 'Chapter 2: Types of Claims under the FECA', '\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Overview</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p >In this chapter we will examine the types of claims under\r\nthe FECA.</p>\r\n<ol type=\\"A\\">\r\n<li><a href=\\"page.php?pageid=22\\">Traumatic Injury</a></li>\r\n<li><a href=\\"page.php?pageid=76\\">Occupational Disease</a></li>\r\n<li><a href=\\"page.php?pageid=86\\">Recurrence</a></li></ol>\r\n\r\n', NULL, NULL),
(22, '2.a', 'Traumatic Injury', '<P><B></B>&nbsp;</P>\r\n<P><B>Traumatic Injury</B></P>\r\n<P>&nbsp;</P>\r\n<P>A traumatic injury is defined as a wound or other condition caused by external force, including physical stress or strain.<SPAN>&nbsp; </SPAN>The injury is identifiable as to time and place of occurrence and member or function of the body affected, and is caused by a specific event or incident or series of events or incidents <B>within a single day or work shift.<SPAN>&nbsp; </SPAN></B>It is this criteria that differentiates a traumatic injury from an occupational disease.</P>\r\n<P>&nbsp;</P>\r\n<P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Click the Next button to continue.</P>', NULL, NULL),
(23, '2.a.1', 'CA-1 form', '\r\n<p>&nbsp;</p>\r\n<p>The CA-1 form has clearly marked instructions attached for\r\nboth the employee and supervisor. Please select Employee or Supervisor\r\nto see the form and important fields for that area.</p>\r\n\r\n<p><b>Please\r\nselect one to begin:</b></p> \r\n<ul><li><a href=\\"page.php?pageid=24\\">Employee Instructions</a></li>\r\n<li><a href=\\"page.php?pageid=30\\">Supervisor Instructions</a></li></ul>', NULL, NULL),
(24, '2.a.1.e', 'CA-1 form Employee', '\r\n\r\n<p>CA-1 form: <b>Employee </b>(or person acting in his/her\r\nbehalf):</p>\r\n<ul><li>Place where injury occurred (be as\r\nspecific as possible, i.e. first floor entrance court unit building).</li></ul>\r\n\r\n\r\n<object alt=''Form Screen shot''  classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/form_p24c.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/form_p24c.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(25, '2.a.1.e.1', 'CA-1 form Employee (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Employee </b>(or person acting in his/her\r\n\r\nbehalf):<o:p></o:p></p><ul><li>Date, time injury occurred, and\r\n\r\ndate notice given.</li></ul>\r\n\r\n\r\n<object  alt=''Form Screen shot''  classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.e.2form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.e.2form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(26, '2.a.1.e.2', 'CA-1 form Employee (continued)', '\r\n\r\n<p>CA-1 form: <b>Employee </b>(or person acting in his/her\r\nbehalf):</p>\r\n<ul><li>Cause of injury, causal relationship\r\nto job. Describe in detail how and why\r\nthe injury occurred.&nbsp; Give appropriate\r\ndetails. (If you fell, how far did you\r\nfall and how did you land? Did you land on your knees, hands, or both?)</li></ul>\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.e.3form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.e.3form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(27, '2.a.1.e.3', 'CA-1 form Employee (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Employee </b>(or person acting in his/her\r\nbehalf):<o:p></o:p></p> <ul><li>Part of body affected. Identify both the injury and the part of body\r\naffected. Specify the right or left side\r\nif applicable. (i.e. cut on right thumb,\r\nfractured left arm.)</li></ul>\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.e.4form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.e.4form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(28, '2.a.1.e.4', 'CA-1 form Employee (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Employee </b>(or person acting in his/her\r\nbehalf):<o:p></o:p></p><ul><li>Election of COP or Annual and/or\r\nSick Leave. It should be noted if the\r\nclaim is denied by OWCP that any COP used is to be <b>charged back to the\r\nemployee?s own leave.</b></li></ul>\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.e.5form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.e.5form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(29, '2.a.1.e.5', 'CA-1 form Employee (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Employee </b>(or person acting in his/her\r\nbehalf):<o:p></o:p></p><ul><li>Original signature of employee or\r\nsupervisor acting in his/her behalf.</li></ul>\r\n\r\n<object  alt=''Form Screen shot''  classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.e.6form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.e.6form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(30, '2.a.1.s', 'CA-1 form Supervisor', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor </b>(or appropriate official of the\r\ncourt unit):<o:p></o:p></p><ul><li>Agency name and address to which\r\ncorrespondence from OWCP should be sent.</li></ul>\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.1form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.1form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(31, '2.a.1.s.1', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor </b>(or appropriate official of the\r\ncourt unit):<o:p></o:p></p><ul><li>Employee?s duty station: address\r\nand zip code where the employee actually works.</li><ul></ul></ul>\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.2form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.2form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(32, '2.a.1.s.2', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor </b>(or appropriate official of the\r\ncourt unit):<o:p></o:p></p><ul><li>Regular work hours and regular\r\nwork schedule. If the employee is\r\nworking a different shift when injured, be sure it is noted on the CA-1\r\n(overtime, Saturday or nights). If on a\r\nrotating shift, include schedule. Date\r\nnotice received is the date Supervisor received notice of injury.</li></ul>\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.3form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.3form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(33, '2.a.1.s.3', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor </b>(or appropriate official of the\r\ncourt unit):<o:p></o:p></p> <ul><li>Date and Time employee stopped\r\nwork and returned. Time lost on Date of\r\nInjury (DOI) should be charged to Administrative Leave if seeking care during\r\nwork hours.</li></ul>\r\n\r\n\r\n<object  alt=''Form Screen shot''  classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.4form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.4form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(34, '2.a.1.s.4', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor </b>(or appropriate official of the\r\ncourt unit):<o:p></o:p></p><ul><li>Performance of duty: An employee\r\nwho is injured on agency premises during work hours has the protection of the FECA\r\nunless engaged in an activity which removes him/her from the scope of\r\nemployment. Coverage includes injuries\r\nthat occur while the employee was performing assigned duties or engaging in\r\nactivity that is reasonably associated with the employment including use of\r\nfacilities for the employee?s comfort, health and convenience, such as eating\r\nmeals and snacks provided on the premises. The premises include areas immediately outside the building, such as\r\nsteps or sidewalks, if they are federally owned or maintained. If in injury occurs in that area, a diagram\r\nof the premises should be sent to OWCP showing where the injury happened.</li></ul>\r\n\r\n\r\n<object  alt=''Form Screen shot''  classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.5form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.5form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>', NULL, NULL),
(36, '2.a.1.S.5', 'Performance of Duty', '\r\n<p>&nbsp;</p>\r\n<p>CA-1 form: <b>Supervisor<o:p></o:p></b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b >Performance of Duty</b></p>\r\n\r\n<ol type=''A''>\r\n\r\n<li><a href=\\"page.php?pageid=37\\">Outside Working Hours</a></li>\r\n\r\n<li><a href=\\"page.php?pageid=38\\">Representational Functions</a></li>\r\n\r\n<li><a href=\\"page.php?pageid=39\\">Parking Facilities</a></li>\r\n\r\n<li><a href=\\"page.php?pageid=40\\">Off-Premises injuries</a></li>\r\n</ol>\r\n', NULL, NULL),
(37, '2.a.1.S.5.1', 'Performance of Duty (continued)', '<P>&nbsp;</P>\r\n<P>CA-1 form: <B>Supervisor</B></P>\r\n<P>&nbsp;</P>\r\n<P><B>Performance of Duty</B></P>\r\n<P>&nbsp;</P>\r\n<P>A. Outside Working Hours:</P>\r\n<P>Coverage is extended to employees who are on the premises for a reasonable time before or after working hours.<SPAN>&nbsp; </SPAN>It is not extended to employees who are visiting the premises for non-work related reasons</P>', NULL, NULL),
(38, '2.a.1.S.5.2', 'Performance of Duty (continued)', '<P>&nbsp;</P>\r\n<P>CA-1 form: <B>Supervisor</B></P>\r\n<P>&nbsp;</P>\r\n<P><B>Performance of Duty</B></P>\r\n<P>&nbsp;</P>\r\n<P>A. Representational Functions:</P>\r\n<P>Injuries to employees performing representational functions entitling them to official time are covered.</P>', NULL, NULL),
(39, '2.a.1.S.5.3', 'Performance of Duty (continued)', '<P>&nbsp;</P>\r\n<P>CA-1 form: <B>Supervisor</B></P>\r\n<P>&nbsp;</P>\r\n<P><B>Performance of Duty</B></P>\r\n<P>&nbsp;</P>\r\n<P>A. Parking Facilities:</P>\r\n<P>Agency?s premises include the parking facilities which it owns, controls, or manages.<SPAN>&nbsp; </SPAN>An employee is usually covered if injured in/on such parking facility.<SPAN>&nbsp; </SPAN>Information should be sent to OWCP as to whether the agency owns or leases parking.<SPAN>&nbsp; </SPAN>\r\nIf leased, the name and address of the owner is needed for the purposes of a third party claim.<SPAN>&nbsp; </SPAN>If parking is not immediately adjacent to the building, a diagram showing where the injury took place in relation to the building should be included in the package going to OWCP.</P>', NULL, NULL),
(40, '2.a.1.S.5.4', 'Performance of Duty (continued)', '\r\n<p>&nbsp;</p>\r\n<p>CA-1 form: <b>Supervisor</b></p>\r\n\r\n<p>&nbsp;</p>\r\n<p><b>Performance of Duty</b></p>\r\n\r\n<p>&nbsp;</p>\r\n<p>D. Off-Premises injuries:</p>\r\n\r\n<p>Coverage is extended to workers\r\nwho perform service away from the agency?s premises.&nbsp; It also includes workers who are sent on\r\nerrands or those who perform services at home.\r\n</p>\r\n<blockquote>\r\n  <ul style=\\"margin-left: 45pt;\\">\r\n      <li><a href="javascript:void();" onmouseover="getObj(''r1'').innerHTML = ''Employees do not have the protection of the FECA when injured en route to/from work, except where the agency furnishes transportation; the employee is required to travel during curfew, or to use his/her automobile during the work day. Lunch Hour: Injuries that occur during lunch hour off the premises are not covered unless the employee is in a travel status or is performing regular duties off premises.'';" onmouseout="getObj(''r1'').innerHTML = '''';"><strong>To/From Work</strong></a><div id="r1"></div></li>\r\n      <li><a href="javascript:void();" onmouseover="getObj(''r2'').innerHTML = ''Employees in travel status are covered 24 hours a day for all reasonable incidents of the temporary duty station (TDY). Therefore, an employee out sightseeing in the city may not be covered, while an employee injured in a hotel shower would be covered. All claims for injuries occurring in travel status should have a copy of the travel authorization included with the CA-1.'';" onmouseout="getObj(''r2'').innerHTML = '''';"><strong>Travel Status</strong></a><div id="r2"></div></li>\r\n      <li><a href="javascript:void();" onmouseover="getObj(''r3'').innerHTML = ''Any auto accident should be accompanied by a police report, diagram, or map showing the location of the accident in relation to the place where official duty was last&nbsp; performed or next scheduled.'';" onmouseout="getObj(''r3'').innerHTML = '''';"><strong>Automobile Accidents</strong></a><div id="r3"></div></li>\r\n      <li><a href="javascript:void();" onmouseover="getObj(''r4'').innerHTML = ''Some injuries occur under circumstances which are not governed, or not completely governed by premises rules such as: recreation, horseplay, assault, and emergencies.&nbsp; Injuries involving any of the above must be determined on a case-by-case basis by OWCP.'';" onmouseout="getObj(''r4'').innerHTML = '''';"><strong>Other</strong></a><div id="r4"></div></li>\r\n    </ul>\r\n</blockquote>', NULL, NULL),
(41, '2.a.1.S.6', 'CA-1 form Supervisor (continued)', '\r\n\r\n\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor<o:p></o:p></b></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<ul><li>Injury caused by a third party?<br>\r\n\r\nWhen a party other than the employee or agency personnel appears to be\r\n\r\nresponsible for an injury or death, the employee may seek damages from that\r\n\r\nparty, which could be an individual or product manufacturer. </li></ul>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.6form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.6form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(42, '2.a.1.S.7', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor</b><o:p></o:p></p>\r\n\r\n\r\n\r\n<ul><li>Date employee first received\r\n\r\nmedical care and the name and address of provider.<span style=\\"\\">&nbsp; </span>If the employee went to the doctor during\r\n\r\nlunch, after hours, or on the weekend, be sure to note it in number 32 &amp; 33.</li></ul>\r\n\r\n\r\n\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.7form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.7form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(43, '2.a.1.S.8', 'CA-1 form Supervisor (continued)', '<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor</b><o:p></o:p></p>\r\n\r\n<ul><li>Does medical show employee unable\r\nto work?<span style=\\"\\">&nbsp; </span>Attach all medical reports\r\n(bills are not medical reports) and certificates with the CA-1 form.</li></ul>\r\n\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.8form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.8form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(44, '2.a.1.S.9', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor</b><o:p></o:p></p>\r\n\r\n<ul><li>The supervisor can controvert\r\n(dispute) COP for any reason.<span style=\\"\\">&nbsp; </span>However,\r\nthe court unit may refuse to pay COP only if the controversion is based upon\r\none of nine reasons (see the instruction sheet attached to the CA-1).</li></ul>\r\n\r\n\r\n<object  alt=''Form Screen shot''  classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.9form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.9form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(45, '2.a.1.S.10', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor</b><o:p></o:p></p>\r\n\r\n<ul><li>After the supervisor has completed\r\nthe information and checked to be sure everything is in order he/she should\r\nsign, date and provide a phone number where he/she can be reached during\r\nworking hours. </li></ul>\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.10form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.10form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(46, '2.a.1.S.11', 'CA-1 form Supervisor (continued)', '\r\n<p class=\\"MsoNormal\\">CA-1 form: <b>Supervisor</b><o:p></o:p></p>\r\n\r\n<ul><li>The supervisor should provide the employee?s\r\nOccupation Code located in the shaded area of # 13a, the code begins with two\r\nletters representing the employee?s pay schedule, (i.e. GS, GM, &amp; WG)\r\nfollowed by the first four digits of their occupation series code.<span style=\\"\\">&nbsp; </span>For judiciary employees use letters\r\n?GS.?<span style=\\"\\">&nbsp;&nbsp; </span>The Benefits Coordinator/HR\r\nSpecialist is responsible for coding #13 b &amp; c (source &amp; type) and for\r\nthe OWCP agency code.</li></ul>\r\n\r\n\r\n<object alt=''Form Screen shot''   classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="750" height="400" id="FormPicture" align="middle">\r\n<param name="allowScriptAccess" value="sameDomain" />\r\n<param name="movie" value="images/2.a.1.s.11form.swf" /><param name="quality" value="high" /><param name="wmode" value="transparent" /><param name="bgcolor" value="#ffffff" /><embed src="images/2.a.1.s.11form.swf" quality="high" wmode="transparent" bgcolor="#ffffff" width="750" height="400" name="FormPicture" align="middle" allowScriptAccess="sameDomain" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />\r\n</object>\r\n<LABEL FOR="FormPicture" style="visibility:hidden">\r\nimage of part of the form\r\n</LABEL>\r\n', NULL, NULL),
(47, '2.a.2', 'Points to Remember Regarding a Traumatic Injury', '<P>&nbsp;</P>\r\n<P>&nbsp;</P>\r\n<TABLE borderColor=black cellSpacing=0 cellPadding=3 border=1  =\\"\\">\r\n<TBODY>\r\n<TR>\r\n<TD><b>Under No Circumstances Should the Employee Be Denied The Right To File a Workers? Compensation Claim.</b>\r\n</TD></TR></TBODY></TABLE>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI>Advise the employee that written notice of injury, (CA-1) must be filed within 30 days of the injury in order to be eligible for COP. This time frame only effects COP, not any other entitlement of the claim (medical, physical therapy, etc).</LI></UL>\r\n\r\n<UL>\r\n<LI>If the employee is incapacitated and unable to complete the CA-1 in the time frame necessary, then the Supervisor should complete the form on the employee?s behalf.&nbsp; The form must contain the original signature of the person giving notice.&nbsp; Supervisor or court unit official should complete and return to the employee \\"Receipt of Notice of Traumatic Injury\\" to be kept for his/her records.</LI></UL>', NULL, NULL),
(48, '2.a.2.1', 'Points to Remember Regarding a Traumatic Injury (continued)', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>If there is time loss, medical expense, and/or the possibility of a disability, within 3 days after the CA-1 is completed, it should be forwarded to OWCP and a copy submitted to the Benefits Division at the Administrative Office.</LI></UL>\r\n\r\n<UL>\r\n<LI>Other documents received after the CA-1 has been sent, should be held until the case file number is received. This number does not mean that the claim has been accepted. It only means that OWCP has received the claim.</LI></UL>\r\n\r\n<UL>\r\n<LI>Advise the employee with emphasis that approval or denial of a claim is made by the Department of Labor and not the Administrative Office or the Court. </LI></UL>\r\n\r\n<UL>\r\n<LI>If COP has been used and the claim is denied by OWCP, the COP must be charged back to the employee?s own leave.</LI></UL>', NULL, NULL),
(50, '2.a.2.2', 'Points to Remember Regarding a Traumatic Injury (continued)', '<P>&nbsp;\r\n<P>Forms Used:\r\n<P>\r\n<UL>\r\n<LI><a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-1.pdf'' target=''_blank''>CA-1</a> (Federal Employee?s Notice of Traumatic Injury and Claim for Continuation of Pay/Compensation).&nbsp;This is the form needed to initiate a claim.&nbsp;The information contained on this form is used throughout the processing of the claim.&nbsp;The dates of filing are extremely important in establishing entitlement to Continuation of Pay (COP). </LI></UL>\r\n\r\n<UL>\r\n<LI>CA-16 (Authorization for Examination and/or Treatment).&nbsp;This form is given only if the injured employee plans to seek immediate medial care.&nbsp;It is not given for an occupational disease or after the employee has sought medical attention. </LI></UL>\r\n\r\n<UL>\r\n<LI><a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-17.pdf'' target=''_blank''>CA-17</a> (Duty Status Report).&nbsp;Side A is completed by the Supervisor, before it is given to the employee or sent to the physician, if there is reason to believe the employee can perform some type of work despite the injury.&nbsp;Remember, light duty may not be consistent with the employee?s regular position. </LI></UL>\r\n\r\n<UL>\r\n<LI>Subsequent forms which may be filed are the \r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-7.pdf'' target=''_blank''>CA-7</a> (Claim for Compensation) and \r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-20.pdf'' target=''_blank''>CA-20</a> (Attending Physician?s Report).</LI></UL>', NULL, NULL),
(51, '2.a.3', 'Handout entitled "Information Regarding Traumatic Injuries"', '<p>&nbsp;</p>\r\n<p>Handout entitled "Information Regarding Traumatic Injuries"</p>\r\n<p>&nbsp;</p>\r\n<ul><li>The following handout should be\r\nattached to all Form CA-1s being issued to any employee filing a traumatic\r\ninjury claim.<o:p></o:p></span></li><li>The employee and the supervisor\r\nshould read then sign the last page of this statement.&nbsp; An additional copy will need to be made for\r\nthe supervisor?s files.</li></ul>\r\n\r\n<p><a href=''Information_Regarding_Traumatic_Injuries.pdf'' target=''_blankl''>Click here to view handout</a></p>', NULL, NULL),
(52, '2.a.4', 'Continuation of Pay (COP)', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>Continuation of Pay (COP) is the continuation of any employee?s regular pay by the employing agency with no charge to sick or annual leave.<SPAN>&nbsp; </SPAN>Because COP is not considered compensation, it is subject to income tax, retirement and other deductions.<SPAN>&nbsp; </SPAN>After entitlement to COP is exhausted, the employee may apply for compensation or use his/her own sick and/or annual leave.<SPAN>&nbsp; </SPAN>It should also be noted that an employee may use his/her annual or sick leave in lieu of COP.<SPAN>&nbsp; </SPAN><?xml:namespace prefix = o /><o:p></o:p></P>', NULL, NULL),
(53, '2.a.4.1', 'Continuation of Pay (COP)', '<P>&nbsp;</P>\r\n<P>COP is only granted to employees who are within FECA time limitations regarding the filing of traumatic injury claims.&nbsp; The maximum time allotment for COP is 45 days.&nbsp; Employees filing occupational claims are not entitled to COP; however, they are entitled to file for additional compensation.&nbsp; </P>', NULL, NULL),
(54, '2.a.4.1.1', 'Continuation of Pay (COP)', '<P>&nbsp;</P>\r\n<P>In order to qualify for COP, the employee must file a written notice of the injury on Form CA-1 ?Federal Employee?s Notice for Traumatic Injury and Claim for Continuation of Pay/Compensation? within 30 calendar days from the date of injury.&nbsp; If the employee fails to file within the 30 days, this does not mean that he or she is not entitled to file for compensation.&nbsp;\r\n Not filing within 30 calendar days will only exclude one from the use of COP.&nbsp; The employee will still be entitled to apply for compensation and to have authorized bills paid.&nbsp; </P>', NULL, NULL),
(55, '2.a.4.1.2', 'Continuation of Pay (COP)', '<P>&nbsp;</P>\r\n<P>It should also be noted that in order to qualify for COP, all time loss must be certified in writing by a physician.&nbsp; Temporary employees, including summer and intern employees as well as part-time employees, are also entitled to COP.</P>\r\n<P>Normally, an employee is only entitled up to 4 hours of COP for a doctor?s appointment.&nbsp; In order to be entitled to a full 8 hours of COP, the doctor?s office must certify that the employee is totally disabled from work.</P>', NULL, NULL),
(56, '2.a.4.2', 'Continuation of Pay (COP)', '<P><B></B>&nbsp;</P>\r\n<P><B>Controversion of COP:</B></P>\r\n<P>&nbsp;</P>\r\n<P>The court can controvert an employee?s claim in its entirety, but the controversion of COP can only be based on the nine following reasons.</P>\r\n<P>&nbsp;</P>\r\n<OL type=1>\r\n<LI>The disability is a result of an occupational disease or illness. \r\n<LI>The employee comes within the exclusions of 5 USC (1) (B) to (E) which refer to persons serving without pay or nominal pay, and to persons appointed to the staff of a former President. \r\n<LI>The employee is neither a citizen nor a resident of the United States, Canada, or the territory under the administration of the Panama Canal Commission (i.e., a foreign national employed outside the area indicated). \r\n<LI>The injury occurred off the employing agency?s premises and the employee was not engaged in official ?off premises? duties. </LI></OL>', NULL, NULL),
(57, '2.a.4.2.1', 'Continuation of Pay (COP)', '<P>&nbsp;</P>\r\n<OL start=5>\r\n<LI>The employee causes the injury by his or her willful misconduct, or intention to bring about his or her injury or death or that of another person, or the employee?s intoxication was the proximate cause of the injury.\r\n<LI>The injury was not reported on a form approved by OWCP (usually Form CA-1) within 30 days of the date of injury.\r\n<LI>Work stoppage first occurred more than 45 days following the injury.\r\n<LI>The employee initially reported the injury after employment was terminated. \r\n<LI>The employee is enrolled in the Civil Air Patrol, Peace Corps, Job Corps, Youth Conservation Corps, work study program or other group covered by special legislation.</LI></OL>', NULL, NULL),
(58, '2.a.4.2.2', 'Continuation of Pay (COP)', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>When the court unit is questioning the case as a whole, this form of controversion must be supported by objective evidence such as witness statements, pictures, accident investigations, or time sheets.<SPAN>&nbsp; </SPAN>The employee?s regular pay must be continued for up to 45 calendar days and may not be interrupted during the 45 day period unless one of the nine contingent reasons for denial comes into play.<?xml:namespace prefix = o /><o:p></o:p></P>', NULL, NULL),
(59, '2.a.4.3', 'Counting COP', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>If the employee uses only 2 hours of <B>COP</B> it is counted against the 45 days as a whole day.<SPAN>&nbsp; </SPAN><B>COP</B> is calculated by days not by hours.<?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P class=MsoNormal><SPAN style=\\"FONT-SIZE: 14pt\\"><o:p>&nbsp;</o:p></SPAN></P>\r\n', NULL, NULL),
(61, '2.a.4.3.1', 'Counting COP', '\r\n<p>&nbsp;</p>\r\n    <p>If the employee does not lose time immediately after their injury, they have 45 calendar days to claim <a href=''#''\r\n onmouseover=\\"getObj(''r1'').style.visibility=''visible'';\\" \r\n onmouseout=\\"getObj(''r1'').style.visibility=''hidden'';\\">COP</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n    <p>(Rollover COP for another calculation sample)</p>\r\n<div id=''r1'' style=''visibility:hidden;''>The employee was injured on May 2nd, returned to duty May 3rd.  The employee would have 45 calendar days from the date of injury to claim COP.  After the 45 days ends their entitlement to COP will also end.</div>', NULL, NULL),
(62, '2.a.4.3.2', 'Counting COP', '\r\n<p>&nbsp;</p>\r\n    <p>If the employee lost time immediately after their injury and  then returned to duty shortly thereafter, he or she would have 45 days from  their first return to duty date to use the remainder of their COP. </p>\r\n    <p>&nbsp;</p>\r\n      <p>Rollover <a href="javascript:void();" onmouseover="getObj(''r1'').innerHTML = ''The employee was injured on May 2nd, then stopped work on May  2nd and did not return to duty until May 10th.&nbsp;  The employee would have until June   23, 45 days from their return to duty date, to use the remainder of  their COP.'';" onmouseout="getObj(''r1'').innerHTML = '''';">here</a> for an example:</p>\r\n      <p><div id="r1"></div></p>', NULL, NULL),
(63, '2.a.4.3.3', 'Counting COP', '\r\n<p>&nbsp;</p>\r\n    <p>The injury occurs before the employee&rsquo;s tour of duty, the  lost time should be recorded as COP.</p>\r\n    <p>&nbsp;</p>\r\n      <p>Rollover <a href="javascript:void();" onmouseover="getObj(''r1'').innerHTML = ''The employee was injured 30 minutes before their scheduled work shift while on government property.  Because the injury occurred before the employee?s work shift, the time and attendance should be recorded as COP for any time loss.'';" onmouseout="getObj(''r1'').innerHTML = '''';">here</a> for an example:</p>\r\n      <p><div id="r1"></div></p>\r\n', NULL, NULL),
(64, '2.a.4.3.4', 'Counting COP', '\r\n<p>&nbsp;</p>\r\n    <p>If the day of injury occurs during the work shift, the lost  time should be recorded as administrative leave.</p>\r\n    <p>&nbsp;</p>\r\n      <p>Rollover <a href="javascript:void();" onmouseover="getObj(''r1'').innerHTML = ''The employee was injured 4 hours into their work shift.  He or she sought medical treatment that same day during working hours. Because the employee left work to seek treatment the day of the injury, the time and attendance should be recorded as administrative leave.'';" onmouseout="getObj(''r1'').innerHTML = '''';">here</a> for an example:</p>\r\n      <p><div id="r1"></div></p>\r\n', NULL, NULL),
(65, '2.a.4.4', 'The 45 Day Time Period For Entitlement To COP', '\r\n<p>&nbsp;</p>\r\n    <p>When an employee returns to work for the first  time after using traumatic leave, he or she has 45 calendar days from their  first return to duty date to use the remainder of their COP.</p>\r\n\r\n<p>&nbsp;</p>\r\n      <p>Rollover <a href="javascript:void();" onmouseover="getObj(''r1'').innerHTML = ''The employee  was injured May 2nd and also stopped work on May 2nd then  returned May 5th.&nbsp; The employee would  have 45 calendar days from the first return to duty date to use the remainder  of their COP.&nbsp; The employee&rsquo;s last day of  entitlement would be June 18th.'';" onmouseout="getObj(''r1'').innerHTML = '''';">here</a> for an example:</p>\r\n\r\n<blockquote>\r\n      <p><div id="r1"></div></p>\r\n</blockquote>', NULL, NULL),
(66, '2.a.4.4.1', 'The 45 Day Time Period For Entitlement To COP', '\r\n<p>&nbsp;</p>\r\n<p>If the employee sustains no lost time due to the injury, he\r\nor she would have 45 calendar days from the date of the injury to use their\r\nCOP.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rollover <a href=\\"javascript:void();\\" onmouseover=\\"getObj(''r1'').innerHTML = ''The employee was injured May 2nd and lost no time from work due to the injury.&nbsp; Because there was no lost time immediately after the injury, the employee has 45 calendar days from the date of the injury to use their COP.&nbsp; The employee\\\\\\''s last day of entitlement would be June 15<sup>th</sup>.'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\">here</a> for an example:</p>\r\n\r\n<p><div id=\\"r1\\"></div></p>\r\n', NULL, NULL),
(67, '2.a.4.4.2', 'The 45 Day Time Period For Entitlement To COP', '\r\n<p>&nbsp;</p>\r\n<p>If an employee is totally disabled by their\r\nphysician beginning before and ending after their regular day off from work,\r\nthese days should be counted as COP.<span style=\\"\\">&nbsp; </span>To\r\nreceive the full day off due to the injury, the doctor must indicate that the employee\r\nis totally disabled from work.<span style=\\"\\">&nbsp; </span>If the\r\ndoctor shows that the employee is only partially disabled or if the employee\r\nwent to the doctor to a scheduled appointment, the employee should only be\r\ngranted up to 4 hours of COP.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rollover <a href=''javascript:void();'' onmouseover=\\"getObj(''r1'').innerHTML = ''The employee\\\\\\''s regular days off from work are Thursdays and Fridays.&nbsp; The employee was injured May 2<sup>nd</sup> (Saturday) and also sought treatment on May 2<sup>nd</sup> and was totally disabled from work by the doctor until May 10<sup>th</sup>.&nbsp; Because the dates of total disability started before and continued after the employee?s regular days off, Thursday and Friday should be entered in time and attendance as COP as if this was the employee\\\\\\''s regular work day.'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\">here</a> for an example:</p>\r\n\r\n<p><div id=\\"r1\\"></div></p>\r\n\r\n\r\n', NULL, NULL),
(68, '2.a.4.4.3', 'The 45 Day Time Period For Entitlement To COP', '\r\n<p>&nbsp;</p>\r\n<p>In some cases the 45 day time period may be bridged by the COP.&nbsp; This means that the employee will receive an extension to the time allotted to use the remainder of the 45 days.&nbsp; This does not mean the employee has additional time added to the 45 days.&nbsp; Once the cycle is broken, the entitlement will end.</p>\r\n\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rollover <a href=''javascript:void();'' onmouseover=\\"getObj(''r1'').innerHTML = ''The employee was injured May 2nd did not return to work until May 10th.&nbsp; The first return to duty date started the countdown of the 45 days to use the remainder of the 45 days (which will end June 24th).&nbsp; Remember at this point the employee has already used 8 days of the 45 days (COP) and have 45 days to use the remainder. The employee has been advised by the physician that he or she will need to have surgery.&nbsp; The surgery is scheduled for May 31st, and the total recovery time is expected to be 5 weeks.&nbsp; (Remember, the employee is still within the 45 day window to use the remainder of the 45 days (COP) and at this point, they have used 20 days and have a total of 25 days left of the 45 day time period).&nbsp; Because the surgery is due to be performed within the 45 day time period, this will allow the employee to use the remainder of the 45 days (COP) past the 45 day allotted time.&nbsp; Please note that once the employee has returned to work, whether part time or full time or if 45 days (COP) ends, this will end the cycle, and if continued compensation is still needed, the employee will need to apply for either a leave&nbsp; buy back and/or file for lost wages.  If the employee wishes, he or she may use their leave and/or file for lost wages.  If the employee wishes, they may take their leave and not apply for any continued compensation.'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\">here</a> for an example:</p>\r\n\r\n\r\n<p><div id=\\"r1\\"></div></p>', NULL, NULL),
(69, '2.a.4.4.2', 'The 45 Day Time Period For Entitlement To COP', '\r\n<p>&nbsp;</p>\r\n<p>If an employee is totally disabled by their\r\nphysician beginning before and ending after their regular day off from work,\r\nthese days should be counted as COP.<span style=\\"\\">&nbsp; </span>To\r\nreceive the full day off due to the injury, the doctor must indicate that the employee\r\nis totally disabled from work.<span style=\\"\\">&nbsp; </span>If the\r\ndoctor shows that the employee is only partially disabled or if the employee\r\nwent to the doctor to a scheduled appointment, the employee should only be\r\ngranted up to 4 hours of COP.</p>\r\n\r\n<p>Rollover <a href=''javascript:void();'' onmouseover=\\"getObj(''r1'').innerHTML = ''The employee\\\\\\''s regular days off from work are Thursdays and Fridays.&nbsp; The employee was injured May 2<sup>nd</sup> (Saturday) and also sought treatment on May 2<sup>nd</sup> and was totally disabled from work by the doctor until May 10<sup>th</sup>.&nbsp; Because the dates of total disability started before and continued after the employee?s regular days off, Thursday and Friday should be entered in time and attendance as COP as if this was the employee\\\\\\''s regular work day.'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\" >here</a> for an example:</p>\r\n\r\n<p><div id=''r1''></div></p>\r\n', NULL, NULL),
(70, '2.a.5', 'Points to Remember Regarding COP', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>If the employee was injured during his or her normal working hours, time lost on the date of injury (DOI) to seek medical care is to be covered by administrative leave. &nbsp; If the employee is injured prior to his or her work shift, time lost to seek medical care should be considered COP. &nbsp; Time lost during working hours after the DOI should also be considered COP.</LI></UL>\r\n\r\n<UL>\r\n<LI>Time allotted for COP is given for only a maximum of 45 calendar days. </LI></UL>\r\n\r\n<UL>\r\n<LI>In order to qualify for COP, the employee must give notice within 30 days from the date of his or her injury.&nbsp;</LI></UL>', NULL, NULL),
(71, '2.a.5.1', 'Points to Remember Regarding COP', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>COP is only given to employees who have sustained traumatic injuries, not occupational illnesses. In the event COP was granted to an employee who initially filed a Form CA-1 and was later converted to an occupational injury by OWCP, the employee?s COP may be subject to denial and changed to some other leave (sick leave, annual leave or LWOP). </LI></UL>\r\n\r\n<UL>\r\n<LI>If COP is granted in a case which is later denied by OWCP, COP may also be subject to denial and should be changed to some other leave (sick, annual or LWOP). The leave should be changed even if the employee is making a request for an appeal through OWCP. In the event the case is later overturned, all leave the employee is entitled to under FECA?s rules and regulations should be reinstated. (Read carefully the denial notice from OWCP to confirm the denial of COP). </LI></UL>', NULL, NULL),
(72, '2.a.5.2', 'Points to Remember Regarding COP', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>In order for employees to claim COP, they must have medical documentation to support their time off from work. If they decide on their own not to return to work, they should not be granted COP. Only the physician can totally or partially disable the injured employee from work. </LI></UL>\r\n \r\n<UL>\r\n<LI>In order for employees to claim COP, they have up to 30 calendar days after the injury to provide written notice of the injury (completing a Form CA-1). They have up to 3 years in which to report an injury. Completing a Form CA-1 after 30 calendar days will only mean the employee is not eligible for COP. It does not mean they are not entitled to further compensation in the event their case is accepted by OWCP. If an employee requests a claim for after more than 3 years, it should still be issued. </LI></UL>', NULL, NULL),
(73, '2.a.5.3', 'Quiz', '\r\n\r\n<p><b>Congratulations!&nbsp; You have completed the traumatic injury and\r\nCOP section of Chapter 2.</b></p>\r\n<p ><b >&nbsp;</b></p>\r\n\r\n<p ><b>To review what you\r\nhave learned, let?s try a few quick questions. </b></p>\r\n', NULL, NULL),
(74, '2.a.5.4', 'Quiz (continued)', '', NULL, NULL),
(75, '2.a.5.5', 'Quiz (continued)', '', NULL, NULL),
(76, '2.b', 'Occupational Disease', '<P>&nbsp;</P>\r\n<P><B>Occupational Disease</B></P>\r\n<P>An occupational disease is defined as a physiological harm or loss of capacity produced by systemic infection; continued or repeated stress or strain; exposure to toxins, poisons, fumes, etc.; or other continued and repeated exposures to conditions of the work environment over a long period of time.<SPAN>&nbsp; </SPAN>For practical purposes, an occupational illness/disease is any reported condition which does not meet the \r\ndefinition of a traumatic injury.</P>\r\n<P>&nbsp;</P>\r\n<P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Click the Next button to continue.</P>', NULL, NULL),
(77, '2.b.1', 'Instructions for the CA-2 Form ', '\r\n<p>&nbsp;</p><p>The CA-2 has attached a clearly marked set of instructions\r\nfor each party to complete.&nbsp; Each party\r\nshould read these instructions and understand what is being asked before\r\ncompleting his/her portion of the claim form.</p>\r\n\r\n<p><b>Please\r\nselect one to begin:</b></p>\r\n\r\n<ul>\r\n  <li><a href=\\"page.php?pageid=78\\">Employee Instructions</a></li>\r\n  <li><a href=\\"page.php?pageid=79\\">Supervisor\r\n    Instructions</a></li>\r\n</ul>', NULL, NULL),
(78, '2.b.1', 'Instructions for the CA-2 Form ', '<P><STRONG></STRONG>&nbsp;</P>\r\n<P><STRONG>Employee &nbsp;(or person acting on the employee?s behalf):</STRONG></P>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI>History of disease or illness. \r\n<LI>Details of the conditions of employment in which&nbsp; the employee should be advised that his/her statement needs to be given to the&nbsp; supervisor for review and comment. \r\n<LI>A description of specific exposures which caused&nbsp; the injury or illness, including when, where and length of time exposed. \r\n<LI>The part of the body that is affected. \r\n<LI>A statement of whether the employee ever&nbsp; suffered a similar condition. \r\n<LI>If there is or was a wage loss or use of leave for</SPAN> the injury, the form CA-7 (Claim for Compensation) should&nbsp; be completed and submitted once the claim is accepted. \r\n<LI>Employee should provide a detailed medical&nbsp; report or arrange for one to be submitted by the treating physician.&nbsp; Report must include: dates of treatment,&nbsp; history of illness or disease, detailed description of the findings, test&nbsp; results, diagnosis, and course of treatment. </LI></UL>', NULL, NULL),
(79, '2.b.1', 'Instructions for the CA-2 Form', '\r\n<p>&nbsp;</p>\r\n<div id=\\"theformimage\\" style=\\"visibility:hidden; position:absolute;position: absolute;top: 210px;left: 370px;\\"><img src=\\"images/FormCA-2croping.jpg\\" alt=\\"picture of a section of the CA-2 form\\" /></div>\r\n<p><strong>Supervisor (or appropriate official in the court unit)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>If the employee has medical expenses and/or lost time is incurred or expected, the CA-2 should be completed and returned to the appropriate coordinator in order for the claim to be submitted to OWCP within ten working days.&nbsp; A separate narrative statement must be attached to the form which provides:</p>\r\n<ul><li><span dir=\\"ltr\\">In detail, the worked performed by the employee.&nbsp; Details should include nature, extent, and duration of exposure.</span></li>\r\n<li><span dir=\\"ltr\\">All available supporting documentation...such as medical reports, and any test result data that was done through the court unit regarding the environment in which the employee worked or was exposed.</span></li>\r\n<li><span dir=\\"ltr\\">A record of the employee?s absence from work, and a statement of reason for the absence.</span></li>\r\n<li><span dir=\\"ltr\\">Any other information or evidence pertinent to</span> the merits of the claim, including any statements from co-workers that have first-hand knowledge regarding the employee?s condition and its cause.&nbsp; </li>\r\n<li><span dir=\\"ltr\\">Review and comment on the accuracy of the employee?s statement which is submitted with his/her claim.</span></li>\r\n<li><span dir=\\"ltr\\">The supervisor is to complete and return to the employee the</span></li>\r\n<li><span dir=\\"ltr\\">?Receipt of Notice of Occupational Disease or Illness? portion of the CA-2 Form, which should be retained by the employee for his/her records.</span></li>\r\n<li><span dir=\\"ltr\\">In addition, the supervisor is to provide the employee?s Occupation Code which is located in the \r\n<a href=\\"#\\" onmouseover=\\"document.getElementById(''theformimage'').style.visibility = ''visible'';\\" onmouseout=\\"document.getElementById(''theformimage'').style.visibility = ''hidden'';\\">?a? shaded portion of item #9 on the CA-2 form under ?Claim Information?</a>.<strong></strong></span></li>\r\n</ul>\r\n', NULL, NULL),
(80, '2.b.2', 'Points to Remember Regarding an Occupational Disease', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>FORMS: CA-2 (Notice of Occupational Disease and Claim for Compensation); CA-35a through CA-35h (appropriate checklist for the condition claimed.)&nbsp; This list will inform the employee and court unit what information must be provided with the claim at the time of filing; CA-7, and sometimes a CA-17 (Duty Status Report). </LI></UL>\r\n\r\n<UL>\r\n<LI>FORMS <B>not to be given </B>for an Occupational Disease: CA-16 (Authorization for Examination and/or Treatment). </LI></UL>\r\n\r\n<UL>\r\n<LI>Find out from the employee if he/she is: (a) still exposed to the circumstances that resulted in the illness, (b) if there is a safety matter to be addressed, (c) if the employee needs a permanent or temporary accommodation to return to work without being put back into harms way.</LI></UL>', NULL, NULL),
(81, '2.b.2.1', 'Points to Remember Regarding an Occupational Disease', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>Find out if the employee has lost time or is now losing time from work due to the illness or treatment of the illness. </LI></UL>\r\n\r\n<UL>\r\n<LI>Ensure the employee understands that with an occupational claim there is <B>no </B>?continuation of pay?, and <B>no benefits </B>until the claim is <B>adjudicated and accepted</B>. </LI></UL>\r\n\r\n<UL>\r\n<LI>Please keep in mind when you have an employee that has only been <B>exposed </B>to an illness, or noxious agent, the exposure <B>does not constitute an injury </B>and OWCP only provides benefits if the employee has sustained an injury; <B>it does not pay for preventative medical care.<SPAN>&nbsp; </SPAN></B>When dealing with a report of exposure <B>only</B>, the employee makes a written report by completing the CA-2. </LI></UL>\r\n\r\n<UL>\r\n<LI>CA-2 is retained in the employee?s medical folder instead of being filed with the Department of Labor.<SPAN>&nbsp; </SPAN>The form can be retrieved and submitted to OWCP at a later date if the employee should sustain an illness due to that exposure. </LI></UL>', NULL, NULL),
(82, '2.b.3', 'Checklists for the Occupational Disease', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>The following checklists should be given to the employee according to which occupational disease they are filing. </LI></UL>\r\n\r\n<UL>\r\n<LI>The employee and supervisor should read and answer their sections of the appropriate checklist. </LI></UL>\r\n\r\n<UL>\r\n<LI>To facilitate submittal of evidence, specific checklists have been devised for various conditions.</LI></UL>\r\n\r\n<blockquote>\r\n<P><a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-35.pdf''>Link to Checklists for Supervisor and Employee</a></P>\r\n</blockquote>', NULL, NULL),
(83, '2.b.3.1', 'Quiz', '\r\n\r\n<p><b>Congratulations!<span style=\\"\\">&nbsp; </span>You\r\nhave completed the Occupational Disease section of Chapter 2.</b></p>\r\n\r\n<p><b>&nbsp;</b></p>\r\n\r\n<p><b>To review what you have learned, let?s try a few quick\r\nquestions.</b></p>\r\n\r\n\r\n\r\n', NULL, NULL),
(84, '2.b.3.2', 'Quiz', '\r\n\r\n\r\n\r\n', NULL, NULL),
(85, '2.b.3.3', 'Quiz', '\r\n', NULL, NULL),
(86, '2.c', 'Recurrence', '<P class=MsoNormal><STRONG></STRONG>&nbsp;</P>\r\n<P class=MsoNormal><STRONG>Recurrence</STRONG></P>\r\n<P class=MsoNormal>A recurrence is defined as: When an employee who has sustained a\r\n traumatic injury or occupational disease suffers disability from work due to the original injury, and such disability occurs after the employee returned to work following the injury, and the disability is the result of (1) a spontaneous return of the symptoms of the previous injury or disease without intervening cause, or (2) the need for medical treatment, other than a usual office visit, for residuals of the previous condition.</P>\r\n<P>&nbsp;</P>\r\n<P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Click the Next button to continue.</P>', NULL, NULL),
(87, '2.c.1', 'Instructions for the CA-2a form', '\r\n<p>&nbsp;</p> \r\n<p>The\r\nCA-2a has attached a clearly marked set of instructions for each party to\r\ncomplete.&nbsp; Each party should read these\r\ninstructions and understand what is being asked before completing his/her\r\nportion of the claim form.</p>\r\n\r\n<p><b>Please\r\nselect one to begin:</b></p>\r\n\r\n<ul>\r\n  <li><a href=''page.php?pageid=88''>Employee\r\n    Instructions</a></li>\r\n  <li><a href=''page.php?pageid=89''>Supervisor\r\n    Instructions</a></li>\r\n</ul>', NULL, NULL),
(88, '2.c.1', 'Instructions for the CA-2a', '\r\n<p>&nbsp;</p>\r\n<p><strong>Recurrence</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n<p><strong>Employee (or person acting on the employee?s behalf):</strong></p>\r\n<ul>\r\n<li>Review the definition of recurrence on the instruction part of the form.&nbsp; If the circumstances meet the ?spontaneous return? or ?medical treatment? definition, then complete the CA-2a.&nbsp; If a new incident or injury occurs which precipitates the disability, even if the injury is to the same part of the body previously injured or is new exposure to the same cause (s) of a previously suffered occupational disease, this constitutes a new injury and Form CA-1 or CA-2 should be filed accordingly.</li>\r\n<li>Complete the Employee?s portion of the CA-2a (part A) completely.</li>\r\n<li>Give the original date of injury and claim number assigned by the Office of Workers? Compensation Programs (OWCP). </li>\r\n<li>Provide detailed information and bridging medical evidence regarding the recurrence.&nbsp; Detailed information may be written on a separate sheet of paper if necessary, explaining why you believe your present condition is related to the original injury. &nbsp; Provide bridging medical evidence that shows the relationship between the original injury and your current medical status.</li> \r\n<li>Describe all injuries and illnesses which you suffered between the date you returned to work following the original injury, and the date of the recurrence. &nbsp; Arrange for the submission of all relevant medical records.&nbsp; In the details, note if you have changed your place of residence or treating physicians since the original injury.</li>\r\n<li>Provide dates of medical treatment following recurrence.&nbsp; If treated by other physicians after returning to work following the original injury, similar medical reports should be obtained from each treating physician.</li>\r\n<li>If the CA-2a is received from a former employee or if a former employee is given instructions regarding a recurrence, please insure that the employee completes ?part C? of the CA-2a.</span> \r\n\r\n</li>\r\n </ul> ', NULL, NULL),
(89, '2.c.1.s', 'Instructions for the CA-2a', '<P><STRONG></STRONG>&nbsp;</P>\r\n<P><STRONG>Supervisor (or appropriate official in the court unit):</STRONG></P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Upon receipt of a claim for recurrence, the supervisor should promptly complete Part B of the form and submit to the appropriate Benefits Coordinator/HR Specialist.</SPAN> &nbsp; \r\n<LI><SPAN dir=ltr>When pay is continued, the supervisor should obtain medical evidence on Form CA-17, Duty Status Report, as often as circumstances indicate.</SPAN> &nbsp; \r\n<LI><SPAN dir=ltr>In many cases, an employee will return to work without using all 45 days of entitlement of COP for the original injury.&nbsp; Should such an employee suffer a recurrence of disability, he/she may use COP if no more than 45 days have elapsed since the first return to work, including part-time work and light duty, following the first work stoppage.&nbsp; If the recurrence begins later than 45 days after the first return to work, the court unit should not pay COP even though some days of entitlement remain.</SPAN> &nbsp; \r\n<LI><SPAN dir=ltr>The supervisor should make sure the effective date of the current position description and current pay rate are reported if there has been any change between the dates of original injury and the recurrence.</SPAN> &nbsp; \r\n<LI><SPAN dir=ltr>The supervisor should review the statements provided by the employee in response to Part A of the form and provide all relevant comments and any additional information.&nbsp; This may be done on a separate sheet of paper.</SPAN> </LI></UL>\r\n', NULL, NULL),
(90, '2.c.2', 'Points to Remember Regarding a Recurrence', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>FORMS: (CA-2a) Federal Employee?s Notice of Recurrence of Disability and Claim for Continuation of Pay/Compensation; CA-17or CA-20; and HCFA-1500. </LI></UL>\r\n\r\n<UL>\r\n<LI>Listen carefully to the employee?s explanation before making a determination regarding the situation.&nbsp; It may be a recurrence or it may be a new injury.&nbsp; Also, remember that a new injury could be or could not be work related. </LI></UL>\r\n\r\n<UL>\r\n<LI>Did the original injury limit the employee?s ability to perform full or part-time duty? </LI></UL>\r\n\r\n<UL>\r\n<LI>Find out where the employee was assigned and his/her resident address at the time of the original injury. </LI></UL>\r\n\r\n<UL>\r\n<LI>Did the employee?s position or pay rate change between the time of original injury and the recurrence?</LI></UL>', NULL, NULL),
(91, '2.c.2.1', 'Quiz', '\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\"><span style=\\"color: black;\\">Congratulations!<span style=\\"\\">&nbsp; </span>You\r\nhave completed the Recurrence section of Chapter 2.<o:p></o:p></span></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\"><span style=\\"color: black;\\"><o:p>&nbsp;</o:p></span></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><b style=\\"\\">To review what you have learned, let?s try a few quick\r\nquestions. </b></p>\r\n\r\n', NULL, NULL),
(92, '2.c.2.2', 'Quiz', '\r\n\r\n', NULL, NULL),
(93, '3', 'Chapter 3: Benefits Under the FECA', '\r\n<p>&nbsp;</p>\r\n<p>In\r\nthis chapter we will review the following benefits under the FECA:</p>\r\n\r\n\r\n<ol type=\\"A\\">\r\n  <li><a href=\\"page.php?pageid=94\\">Medical Benefits</a></li>\r\n  <li><a href=\\"page.php?pageid=100\\">Disability Benefits</a></li>\r\n  <li><a href=\\"page.php?pageid=125\\">Death Benefits</a></li>\r\n</ol>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote>\r\n          <p>Click the Next button to continue.</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote>', NULL, NULL),
(94, '3.a', 'Medical Benefits', '<P>&nbsp;</P>\r\n<P>The FECA provides compensation for medical services that are required to treat, counteract or minimize the effects of any condition, disease, or injury judged to be causally related to employment with the federal government.<SPAN>&nbsp; </SPAN>There is no limit to the amount of medical expenses paid, nor to the length of time for which expenses are paid, as long as the need for medical treatment can be substantiated as related to the injury or disease sustained on the job.<?xml:namespace prefix = o /><o:p></o:p></P>', NULL, NULL),
(95, '3.a.1', 'Medical Benefits', '<P>&nbsp;</P>\r\n<p>The employee is entitled to the use of Federal medical\r\nfacilities and physicians.<span style=\\"\\">&nbsp; </span>Such\r\nfacilities include medical officers and hospitals of the Army, Navy, Air Force\r\nand Veterans Administration.<span style=\\"\\">&nbsp; </span>The\r\nemployee may elect to utilize the services of his/her local physician or\r\nhospital (generally, ?local? is defined as within 25 miles from the place of\r\ninjury, place of employment, or the employee?s home) of his/her choice as long\r\nas the physician is not on the list of medical providers who are excluded from\r\npayment under the FECA. </p>\r\n\r\n', NULL, NULL),
(96, '3.a.2', 'Medical Benefits', '<P>&nbsp;</P>\r\n<P>Compensation will be paid for first aid, medical treatment,&nbsp; hospitalization, and expenses for travel to obtain medical treatment, as well&nbsp; as for any prescription drug, appliance or other supplies directed for use by a&nbsp; qualified physician.&nbsp; Only original bills&nbsp; for hospital expenses and original HCFA-1500 forms for doctor?s bills should be&nbsp; submitted to OWCP for payment.<BR></P>\r\n<P>Payment of bills to chiropractors is limited to treatment&nbsp; for manual manipulation of the spine to correct a subluxation as demonstrated&nbsp; to exist by x-ray.</P>&nbsp; \r\n<P><STRONG>OWCP Will Not Pay For Preventative Treatment</STRONG></P>', NULL, NULL),
(97, '3.a.3', 'Medical Benefits', '<P>&nbsp;</P>\r\n<p><strong>Medical Documentation</strong></p>\r\n<p>Medical documentation consists of the following:</p>\r\n<ul><li>Progress notes from the Doctors office or&nbsp; Hospital</li>\r\n<li>A physician?s letter</li> <li>CA-16 form, \r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-17.pdf'' target=''_blank''>CA-17 form</a>, and \r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-20.pdf'' target=''_blank''>CA-20 form</a></li></ul>\r\n<p>Medical bills must be put on the following forms:</p>\r\n<ul><li>\r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/OWCP-1500.pdf'' target=''_blank''>HCFA-1500</a></li>\r\n<li><a href=''http://www.dol.gov/esa/regs/compliance/owcp/UB-92.pdf'' target=''_blank''>UB92&nbsp; and/or UB82</a></li>\r\n<li>Ambulance bill</li>\r\n<li>Prescription form</li></ul>\r\n<p><strong>A medical bill does not&nbsp; replace a medical report. </strong></p>\r\n<p><b><i>Note: CA-16 form is not downloadable.</i></b></p>', NULL, NULL),
(98, '3.a.4', 'Medical Benefits', '<P>&nbsp;</P>\r\n\r\n\r\n<p><b>Surgery</b></p>\r\n\r\n<p class=\\"MsoBodyText\\"><span style=\\"font-size: 12pt; font-family: &quot;Times New Roman&quot;;\\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\\"MsoNormal\\">Approval must be obtained in advance from OWCP for any\r\nsurgical procedure in order to insure payment.<o:p></o:p></p>\r\n\r\n<p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\\"MsoNormal\\">To obtain approval, contact OWCP at least 30 days before the\r\nprocedure to request authorization.<span style=\\"\\">&nbsp;\r\n</span>Arrangements should be made for the doctor to submit a medical report\r\nstating the need for the surgery and the expected benefits.<span style=\\"\\">&nbsp; </span>OWCP will notify the claimant in writing\r\nwhether the surgery is authorized.<o:p></o:p></p>\r\n\r\n', NULL, NULL),
(99, '3.a.5', 'Medical Benefits', '<P><STRONG></STRONG>&nbsp;</P>\r\n<P><STRONG>Medical Benefits</STRONG></P>\r\n<P><STRONG></STRONG>&nbsp;</P>\r\n<P><STRONG>Surgery</STRONG></P>\r\n<P>If surgery was performed without approval, arrangements for&nbsp; the submission of a report from your doctor stating the reason why the surgery was necessary will be needed.&nbsp;&nbsp; Arrangements should also be made for the submission of a copy of the pre- and post operative report.</P>\r\n<P style=\\"MARGIN-LEFT: 40px\\">Note:&nbsp; A second opinion medical examination maybe required in some instances.</P>\r\n<P>Surgery&nbsp; must occur within one year of acceptance, not after.&nbsp; If it is not done within this time limit, it&nbsp; must be re-authorized by OWCP.</P>', NULL, NULL),
(100, '3.b', 'Disability Benefits', '<P><B></B>&nbsp;</P>\r\n<P><B>Disability Benefits</B></P>\r\n<P><B></B>&nbsp;</P>\r\n<P><B>Compensation for Wage Loss After the 45 days of COP.</B></P>\r\n<P>If an injured employee elects to be paid directly through OWCP instead of receiving their pay from the agency by using their leave, he or she may file for lost wages during the period of disability.<SPAN>&nbsp; </SPAN>Even after the employee has returned to work but continues to require medical treatment during working hours he or she may claim compensation for lost wages.<SPAN>&nbsp; </SPAN>A claim for lost wages may be used in conjunction with a claim for leave buy-back.</P>\r\n<P>All forms referenced&nbsp;on the next page&nbsp;have attached clearly marked instructions for both the employee and supervisor.<SPAN>&nbsp; </SPAN>Each party should read these instructions and understand what is being asked before completing his or her portion of the claim forms.</P>', NULL, NULL),
(101, '3.b.1', 'Compensation for Wage Loss', '<P>&nbsp;</P>\r\n\r\n<p><b>Compensation for Wage\r\nLoss</b></p>\r\n\r\n<p ><b>&nbsp;</b></p>\r\n\r\n<p ><b >Forms Needed</b></p>\r\n\r\n\r\n\r\n<p class=\\"MsoNormal\\" style=\\"margin-left: 1.5in; text-indent: -1.5in;\\">Form\r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-7.pdf'' target=''_blank''>CA-7</A>:<span style=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Claim\r\nfor Compensation on Account of Traumatic Injury or Occupational Disease<o:p></o:p></p>\r\n\r\n<p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\\"MsoNormal\\" style=\\"margin-left: 1.5in; text-indent: -1.5in;\\">Form \r\n<a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-20.pdf'' target=''_blank''>CA-20</a>:<span style=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Attending\r\nPhysician?s Report<o:p></o:p></p>\r\n\r\n', NULL, NULL),
(102, '3.b.1.1', 'Compensation for Wage Loss', '<P>&nbsp;</P>\r\n\r\n<div id="r1" style="visibility:hidden;position:absolute;position: absolute;top: 210px;left: 500px;"><img src="images/ca7page1.jpg" alt="picture of page 1 of CA-7 form"></div>\r\n<p><b>Compensation for Wage\r\nLoss</b></p>\r\n<p>&nbsp;</p>\r\n<p><b>Injured Employee?s\r\nResponsibility</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Form\r\nCA-7</p>\r\n\r\n<ul>\r\n<li>Complete sections \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >1, 2, 3, 4, 5, 6</a>\r\n, and \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >7</a>.<span style=\\"\\">&nbsp; </span>If any of the information does not apply to\r\nthe employee, he or she should indicate this by writing N/A.</li>\r\n<li>Form CA-20 (Note the CA-20 is attached to the\r\nForm CA-7).</li></ul>\r\n\r\n\r\n\r\n<p>This\r\nform does not need to be completed by the employee?s physician unless there is\r\nno other medical documentation to support the period of disability.</p>\r\n\r\n<p>OWCP will make deductions for the\r\ninjured employee?s health insurance and FEGLI Life Insurance benefits</p>\r\n', NULL, NULL),
(103, '3.b.1.2', 'Compensation for Wage Loss', '<P>&nbsp;</P>\r\n\r\n<div id="r1" style="visibility:hidden;position:absolute;position: absolute;top: 210px;left: 500px;"><img src="images/ca7page2.jpg" alt="picture of page 2 of CA-7 form"></div>\r\n<p class=\\"Level1\\" style=\\"margin-left: 0in; text-indent: 0in;\\"><b style=\\"\\">Compensation for Wage\r\nLoss<o:p></o:p></b></p>\r\n\r\n<p class=\\"Level1\\" style=\\"margin-left: 0in; text-indent: 0in;\\"><b style=\\"\\"><o:p>&nbsp;</o:p></b></p>\r\n\r\n<p class=\\"Level1\\" style=\\"margin-left: 0in; text-indent: 0in;\\"><b style=\\"\\">Supervisor?s\r\nResponsibility<o:p></o:p></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\\"MsoNormal\\">Review and complete sections \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >8, 9, 10, 11, 12, 13, 14,</a> and \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >15.</a><span style=\\"\\">&nbsp; </span>Please note that the Benefits Coordinator/HR\r\nSpecialist will provide the majority of the needed information before the supervisor\r\nsees the form.<o:p></o:p></p>\r\n\r\n', NULL, NULL),
(104, '3.b.1.3', 'Compensation for Wage Loss', '<P><B></B>&nbsp;</P>\r\n<P><B>Compensation for Wage Loss </B></P>\r\n<P>&nbsp;</P>\r\n<P><B>Points to Remember Regarding Lost Wages</B></P>\r\n<UL>\r\n<LI>Filing for lost wages permits the employee to be paid directly by OWCP for their work-related injury or disease. \r\n<LI>The forms used are Forms CA-7 (Claim for Compensation on Account of Traumatic Injury or Occupational Disease) and CA-7a (Time Analysis Form), if applicable. \r\n<LI>A claim for lost wages cannot be processed until the injury has been approved by OWCP. \r\n<LI>The agency must complete the request for lost wages before submission to OWCP. \r\n<LI>The employee must have medical documentation to support any and all time lost.<SPAN>&nbsp; </SPAN>If the employee does not provide medical documentation, unlike a claim for leave-buy back, you should still send the Claim Form CA-7 to OWCP.</LI></UL>', NULL, NULL),
(105, '3.b.1.4', 'Compensation for Wage Loss', '<P><B></B>&nbsp;</P>\r\n<P><B>Compensation for Wage Loss</B></P>\r\n<P>&nbsp;</P>\r\n<P><B>Points to Remember Regarding Lost Wages</B></P>\r\n<UL>\r\n<LI>To continue reporting lost wages, Form CA-7 should be used unless OWCP advises to cease submission. \r\n<LI>OWCP pays based on whether the injured employee has received COP.<SPAN>&nbsp; </SPAN>If the employee received COP, their pay will be based on their salary at the time of the injury.<SPAN>&nbsp; </SPAN>If the employee did not receive COP, compensation will be based on the current rate of pay.<SPAN>&nbsp; </SPAN>Compensation is also paid at 66 2/3 or 75 percent of the employee?s salary based on whether the claimant has dependents. \r\n<LI>There is a three day waiting period for any employee filing for continued compensation (leave buy-back and/or lost wages) if the requested amount of days is under 14 days.<SPAN>&nbsp; </SPAN>For example, if the employee elects to buy back only 10 days of sick or annual leave, that employee will only be entitled to have 7 of those days restored back to their leave balance.<SPAN>&nbsp; </SPAN>If the employee eventually does need to buy-back and/or file for lost wages for more than 14 days after the initial process has begun, the employee can be compensated for the three days initially deducted.</LI></UL>', NULL, NULL),
(106, '3.b.2', 'Leave Buy-Back', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>If an injured employee elects to use sick or annual leave during a period of disability, the employee may at a later date buy back the leave used.<SPAN>&nbsp; </SPAN>A buy-back permits the employee to reinstate leave used due to a work-related injury or disease.<SPAN>&nbsp; </SPAN>Even after the employee has returned to work but continues to require medical treatment during working hours he or she may claim compensation for leave buy-back.<SPAN>&nbsp; </SPAN>A leave buy-back may also be used in conjunction with a claim for lost wages.</P>\r\n<p><a target=''_blank'' href=''Visio-Leave_Buy_Back_Flowchart.pdf''>Click Here</a> for the Leave Buy Back Flowchart</p>', NULL, NULL),
(107, '3.b.2.1', 'Instructions for Filing a Leave Buy-Back', '<P class=MsoNormal>All below referenced forms have attached clearly marked instructions for both the employee and supervisor.<SPAN>&nbsp; </SPAN>Each party should read these instructions and understand what is being asked before completing his or portion of the claim forms.<?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P>&nbsp;</P>\r\n<P class=MsoNormal>Forms Needed<U><o:p></o:p></U></P>\r\n<P>&nbsp;</P>\r\n<P>&nbsp;</P>\r\n<P>Form <U><A target=''_blank'' href=\\"http://www.dol.gov/esa/regs/compliance/owcp/ca-7.pdf\\">CA-7</A></U>:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Claim for Compensation on Account of Traumatic Injury or Occupational Disease</P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P>Form <U><A target=''_blank'' href=\\"http://www.dol.gov/esa/regs/compliance/owcp/ca-20.pdf\\">CA-20</A></U>:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Attending Physician?s Report</P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P>Form <U><A target=''_blank'' href=\\"http://www.dol.gov/esa/regs/compliance/owcp/ca-7a.pdf\\">CA-7a</A></U>:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Time Analysis Form</P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P>Form <U><A target=''_blank'' href=\\"http://www.dol.gov/esa/regs/compliance/owcp/ca-7b.pdf\\">CA-7b</A>:</U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Leave Buy-Back (LBB) Worksheet/Certification and Election</P>', NULL, NULL),
(108, '3.b.2.2', 'Injured Employee?s Responsibility', '\r\n<div id="r1" style="visibility:hidden;position:absolute;position: absolute;top: 210px;left: 500px;"><img src="images/ca7page1.jpg" alt="picture of page 1 of CA-7 form"></div>\r\n\r\n<p>Form CA-7</p>\r\n\r\n<p>Complete\r\nsections \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >1, 2, 3, 4, 5, 6, </a>\r\n&amp; \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >7.</a><span style=\\"\\">&nbsp; </span>If any of the information does not apply to\r\nthe employee he or she should indicate this by writing N/A.</p>\r\n\r\n', NULL, NULL),
(109, '3.b.2.2.a', 'Injured Employee?s Responsibility', '<P>&nbsp;</P>\r\n<P>&nbsp;</P>\r\n<P>Form <a href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-20.pdf'' target=''_blank''>CA-20:</a></P>\r\n<P>This form does not need to be completed by the employee?s physician unless the employee does not have medical documentation.</P>', NULL, NULL),
(110, '3.b.2.2.b', 'Injured Employee?s Responsibility', '<div id="r1" style="visibility:hidden;position:absolute;position: absolute;top: 180px;left: 500px;"><img src="images/ca7a.jpg" alt="picture of page 1 of CA-7a form"></div>\r\n\r\n<p>Form\r\nCA-7a items:</p>\r\n\r\n<p ><a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >Complete 1 through 6</a>, then sign and date the\r\nform. </p>\r\n\r\n<p>For\r\nthe dates entered in item 6, the injured employee should show only the dates he\r\nor she wishes to buy-back along with the other requested information on the\r\nform.<span style=\\"\\">&nbsp; </span>If these dates are consecutive,\r\nthe employee may indicate this by showing the start date through to the ending\r\ndate.<span style=\\"\\">&nbsp; </span>If these days are intermittent,\r\nthe employee will need to indicate each individual day.<span style=\\"\\">&nbsp; </span>If the employee used a full 8 hours of sick\r\nleave or annual leave for any of the days listed and was only entitled to claim\r\na portion of that day due to their injury, the employee should only indicate\r\nthe amount of leave used for the injury.<span style=\\"\\">&nbsp;\r\n</span>Keep in mind that the employee is only entitled up to 4 hours for a\r\ndoctor?s appointment and/or physical therapy appointments.</p>\r\n\r\n', NULL, NULL),
(111, '3.b.2.3', 'Supervisor?s Responsibility', '<div id=\\"r1\\" style=\\"visibility:hidden;position:absolute;position: absolute;top: 210px;left: 500px;\\"><img src=\\"images/ca7page2.jpg\\" alt=\\"picture of CA-7 form\\"></div>\r\n<P>Form&nbsp; CA-7:</P>\r\n<P>Review&nbsp; and complete sections \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >8, 9, 10, 11, 12, 13, 14 ,</a> and\r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" > 15</a>.&nbsp; If any items do not apply, indicate by&nbsp; writing N/A.</P>\r\n<P>Form&nbsp; CA-7a:</P>\r\n<P>The supervisor should review the dates listed and compare them with time and&nbsp; attendance records to ensure accuracy.&nbsp;&nbsp; Before signing the form the supervisor should confirm with the&nbsp; Coordinator that adequate medical documentation has been provided.</P>', NULL, NULL),
(112, '3.b.2.4', 'Benefits Coordinator/HR  Specialist?s Responsibility', '\r\n<p>&nbsp;</p>\r\n<P \\>The coordinator/specialist is responsible for ensuring the accuracy of all information indicated on all forms.<SPAN>&nbsp; </SPAN>He or she is also responsible for ensuring that medical documentation is on file to support all dates indicated for the leave buy-back.<SPAN>&nbsp; </SPAN>If any information is missing or is incomplete,\r\n the coordinator/specialist should ensure all corrections are made prior to the information being submitted to OWCP for processing.</P>\r\n<P><a target=''_blank'' href=''page.php?pageid=175''>Click Here for the Benefits Coordinator/HR Specialist Checklist</a></P>', NULL, NULL),
(113, '3.b.2.5', 'Benefits Coordinator/HR  Specialist?s Responsibility', '<P><B></B>&nbsp;</P>\r\n<P><B>Example of a Leave Buy-Back </B></P>\r\n<P>&nbsp;</P>\r\n<P>A pre-requisite for payment of compensation is that the employee?s pay records reflect Leave Without Pay (LWOP) status.<SPAN>&nbsp; </SPAN>If an employee elects to use annual or sick leave as a result of a work injury rather than entering LWOP status to claim compensation, he or she may at a later date, request compensation for Leave Buy-Back.<SPAN>&nbsp; </SPAN>The employee is entitled to an equivalent amount of temporary total disability compensation which would have been paid had the employee not been in a leave status.<SPAN>&nbsp; </SPAN>This is accomplished by a leave buy back.<?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P><o:p>&nbsp;</o:p></P>\r\n<P>When the employee receives leave payment from the court unit, it is at 100% his or her salary.<SPAN>&nbsp; </SPAN>OWCP pays compensation at 75% (with dependents) and 66 2/3% (without dependents).<SPAN>&nbsp; </SPAN>The amount of compensation paid by OWCP, therefore, is generally less than the amount of pay the employee received while using leave.<SPAN>&nbsp; </SPAN>To complete a leave buy-back, the employee must pay the difference between the 100% paid by the agency and the compensation received from OWCP.</P>', NULL, NULL),
(114, '3.b.2.6', 'Benefits Coordinator/HR  Specialist?s Responsibility', '<P>&nbsp;</P>\r\n<P>The following example illustrates how leave buy-back works:</P>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI>Date of Injury: April 1, 2005 (traumatic injury) <br>&nbsp;</li>\r\n<LI>Entitlement to 45 days of continuation of pay expires on May 16, 2005 <br />&nbsp;</li>\r\n<LI>The employee elects to use sick leave until he is released to work effective May 31, 2005 <br />&nbsp;</li>\r\n<LI>The employee?s weekly pay rate on the date of injury was $546 per week <br />&nbsp;</li>\r\n<LI>Employee has a wife and two children (compensation entitlement is at 75%) <br />&nbsp;</li>\r\n<LI>OWCP calculates the weekly pay rate at $409.50 ($546 x 75%).&nbsp; For the two-week period claimed, total compensation entitlement is $819 <br />&nbsp;</li>\r\n<LI>The court unit has paid leave at 100% ($546 x 2 weeks = $1,092 <br />&nbsp;</li>\r\n<LI>The difference is $273</LI>\r\n</UL>\r\n<P>&nbsp;</P>\r\n<P><STRONG><EM>Please Note: All monies must be refunded to the Administrative Office before leave is restored.&nbsp; (OWCP?s portion plus the amount the employee owes).</EM></STRONG></P>', NULL, NULL),
(115, '3.b.2.7', 'Benefits Coordinator/HR  Specialist?s Responsibility', '<P>&nbsp;</P>\r\n<P>It is the responsibility of the employee to arrange with the agency repayment of the difference.</P>\r\n<P>&nbsp;</P>\r\n<P>The benefits to the employee of proceeding with leave buy back is realized at tax time.<SPAN>&nbsp; </SPAN>Compensation is not taxable.<SPAN>&nbsp; </SPAN>The taxes that had been deducted from the employee?s leave are recovered when the employee files his/her tax return.<SPAN>&nbsp; </SPAN>Some basic criteria which must be met to warrant restoration of leave include:</P>\r\n<P>Medical support for all periods of disability claimed.</P>\r\n<P>All entitlement to continuation of pay must have been exhausted in traumatic injury claims. </P>\r\n<P>Three waiting days are applicable unless disability claimed is more than 14 calendar days.</P>\r\n<P>&nbsp;</P>\r\n<P>A leave buy-back cannot be processed at the same time an employee is receiving a schedule award, this would be considered a double payment.<SPAN>&nbsp; </SPAN>Once the schedule award ends the employee may request leave buy-back for dates of medical treatment. </P>', NULL, NULL),
(116, '3.b.2.8', 'Benefits Coordinator/HR  Specialist?s Responsibility', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>Health Benefits and optional life insurance are not made by OWCP when the employee requests leave buy-back.<SPAN>&nbsp; </SPAN>The reason for this is because the court unit made the deductions when the employee was in a leave status.<SPAN>&nbsp; </SPAN>As leave buy back is an agency? s discretion, a primary factor is whether the court unit is willing and able to change the employee?s leave records from leave with pay to LWOP.<SPAN>&nbsp; </SPAN>If this is possible, leave buy-back can be processed by OWCP.<?xml:namespace prefix = o /><o:p></o:p></P>', NULL, NULL),
(117, '3.b.2.9', 'Points to Remember Regarding a Leave Buy-Back', '<P><SPAN dir=ltr></SPAN>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>A leave buy-back permits the employee to reinstate leave used due to a work-related injury or disease.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>The forms used are Forms CA-7 (Claim for Compensation On Account of Traumatic Injury or Occupational Disease), CA-7a (Time Analysis Form) and CA-7b (Leave Buy Back (LBB) Worksheet/Certificate and Election).</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>The employee must be in some form of work status before attempting to buy back leave.&nbsp; (Full time and part time)</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>A buy-back cannot be processed by OWCP until the injury/illness claim has been accepted.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>The employee must have medical documentation prior to the forms being submitted to OWCP.</SPAN> </LI></UL>', NULL, NULL),
(118, '3.b.2.10', 'Points to Remember Regarding a Leave Buy-Back', '<p>&nbsp;</p>\r\n<ul>\r\n<li>If the employee is on LWOP the&nbsp; last hour of the day before a holiday and at the beginning of the business day&nbsp; after a holiday, the holiday must be included in the buy-back period.<br />&nbsp;</li>\r\n<li>There is a ?three day waiting&nbsp; period? for any employee filing for continued compensation (leave buy-back&nbsp; and/or lost wages) if the requested amount of days is under 14 days.&nbsp; For example, if the employee elects to buy&nbsp; back only 10 days of sick or annual leave, that employee will only be entitled&nbsp;\r\n to have 7 of those days restored to their leave balance.&nbsp; If the employee eventually does need to buy-back&nbsp; more than 14 days after the initial process has begun, the employee will be&nbsp; compensated for the three days initially deducted.&nbsp;<br />&nbsp;</li>\r\n<li>All monies must be in place before&nbsp; any leave is restored to the employee.&nbsp; OWCP?s check and the injured employee?s check must be received by the&nbsp; Administrative Office before leave is restored.<br />&nbsp;</li>\r\n<li>OWCP will pay based on the employee?s salary at the rate earned at the time the leave was used.&nbsp; Compensation is also paid at 66 2/3; or 75 percent of the employee''s salary based on the dependent status.<br />&nbsp;</li>\r\n</ul>', NULL, NULL),
(119, '3.b.3', 'Schedule Award', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>A schedule award is a compensation benefit paid to the injured employee for a specified period of time for a permanent loss, or the loss of use, of certain parts and functions of the body.<?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P>&nbsp;</P>', NULL, NULL),
(120, '3.b.3.1', 'Instructions for Filing a Schedule Award', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>The Form CA-7 (Claim for Compensation) and CA-20 (Physician?s Report) are used when the employee is filing for a schedule award. </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI>The attending physician must affirm that the employee has a permanent loss or loss of function of one of the members of the body or organs enumerated in the regulations (20 CFR 10.304).<SPAN>&nbsp; </SPAN>Also, the attending physician must affirm that maximum medical improvement of the condition has been reached.<SPAN>&nbsp; </SPAN>Functional loss of the member and the resulting impairment in accordance with the American Medical Association Guides of the Evaluation of Permanent impairment must be clearly stated.<SPAN>&nbsp; </SPAN>See the Compensation Schedule for specified periods of time for the permanent loss, or loss of use, of certain parts and functions of the body. </LI></UL>', NULL, NULL),
(121, '3.b.3.2', 'Instructions for Filing a Schedule Award', '<p>&nbsp;</p>\r\n<div id="r1" style="visibility:hidden;position:absolute;position: absolute;top: 210px;left: 500px;"><img src="images/ca7page1.jpg" alt="picture of page 1 of CA-7 form"></div>\r\n<div id="r2" style="visibility:hidden;position:absolute;position: absolute;top: 210px;left: 500px;"><img src="images/ca7page2.jpg" alt="picture of page 2 of CA-7 form"></div>\r\n<ul><li>Once the\r\nattending physician has made a medical report stating the given factors of\r\nloss, the employee will complete the following portions of the CA-7:<br>\r\n<br>\r\nSections <a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" >1, 2, 3, 4, 5, 6, </a>&amp;<a href=\\"#\\" onMouseOver=\\"getObj(''r1'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r1'').style.visibility =''hidden'';\\" > 7</a>.<span style=\\"\\">&nbsp; </span>If any information does not apply N/A should\r\nbe indicated.</li>\r\n</ul>\r\n<br>\r\n<ul>\r\n<li>Once the\r\nemployee has completed his or her portion of the CA-7, then the supervisor or\r\nauthorizing official should complete the following portions with the help of\r\nthe employee:<br><br>Review and complete sections \r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r2'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r2'').style.visibility =''hidden'';\\" >8, 9, 10,\r\n11, 12, 13, 14, </a>and\r\n<a href=\\"#\\" onMouseOver=\\"getObj(''r2'').style.visibility =''visible'';\\" onMouseOut=\\"getObj(''r2'').style.visibility =''hidden'';\\" > 15</a>.<span style=\\"\\">&nbsp; </span>The\r\ncoordinator/specialist will complete the majority of sections 8 through 14\r\nbefore the form is given to the supervisor.</li>\r\n</ul>\r\n\r\n\r\n\r\n\r\n\r\n', NULL, NULL),
(122, '3.b.3.3', 'Points to Remember Regarding a Schedule Award', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>Employee may or may not be entitled to a schedule award depending what part of the body is affected.<SPAN>&nbsp; </SPAN>The law contains no provision for payment of a schedule award on account of permanent impairment to the <B>back</B>, <B>heart or brain.</B><SPAN>&nbsp; </SPAN>All final decisions are made by OWCP. </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI>When a schedule award is issued, the employee and agency will be notified of the length of the award (number of weeks or days), the starting date and at what rate of compensation the award will be paid.<SPAN>&nbsp; </SPAN>The rate is 66 2/3% of his or her gross salary for a single person or 75% for a person with one or more dependents.<SPAN>&nbsp; </SPAN>The decision includes a description of the employee?s appeal rights should he or she disagree with any element of the decision.</LI></UL>', NULL, NULL),
(123, '3.b.3.4', 'Points to Remember Regarding a Schedule Award', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>Schedule awards can be paid even if the employee returns to work.<SPAN>&nbsp; </SPAN>The employee may not, however; receive wage loss compensation and schedule award benefits concurrently for the same injury.</LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI>Before payment of a schedule award can be considered, the condition of the affected part of the body must reach maximum improvement.<SPAN>&nbsp; </SPAN>This determination involves a medical judgment that the condition has permanently stabilized.</LI></UL>', NULL, NULL),
(124, '3.b.3.5', 'Points to Remember Regarding a Schedule Award', '<P>&nbsp;</P>\r\n<UL>\r\n<LI>FECA provides schedule award&nbsp; payments for disfigurement not to exceed $3500 for injury to the face, neck or&nbsp; head if the disfigurement will likely prove to be a handicap in securing or&nbsp; maintaining employment. </LI></UL>\r\n\r\n<UL>\r\n<LI><a href=''page.php?pageid=178''>The Compensation Schedule</a> states&nbsp; the number of weeks payable at 100% loss, or the 100% loss of function, of the&nbsp; member.&nbsp; If the employee has a percentage&nbsp; of loss rate less than 100% , then the award will be based on that percent rate&nbsp; times the number of weeks of the affected member of the body.</LI></UL>', NULL, NULL),
(125, '3.c', 'Death Benefits', '<p>&nbsp;</p>\r\n<p>The survivors of a Federal employee whose death is causally\r\nrelated to employment are entitled to benefits in the form of monthly\r\ncompensation payments, transportation of the remains (if necessary), funeral,\r\nand burial expenses up to a maximum of $800.<span style=\\"\\">&nbsp;\r\n</span>In addition, a sum of $200 may be paid for the termination of the\r\ndeceased''s status as a Federal employee.</p>\r\n\r\n\r\n', NULL, NULL),
(126, '3.c.1', 'Information Regarding Death Benefits', '<P>&nbsp;</P>\r\n<P><A target=''_blank'' href=\\"http://www.dol.gov/esa/regs/compliance/owcp/ca-5.pdf\\">Form CA-5</A>:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Claim for Compensation by Widow, Widower, and/or Children</P>\r\n<P>&nbsp;</P>\r\n<P><a  target=''_blank''  href=''http://www.dol.gov/esa/regs/compliance/owcp/ca-6.pdf''>Form CA-6</a>:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Official Supervisor''s Report of Employee''s Death</P>\r\n<P>&nbsp;</P>\r\n<P>The following individuals are entitled to benefits:</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Widow or widower.</SPAN> \r\n<LI><SPAN dir=ltr>Unmarried child under the age of 18, or over the age of 18 who is incapable of self support due to mental or physical disability.</SPAN> \r\n<LI><SPAN dir=ltr>A child between 18 and 22 years of age who has not completed four (4) years of post high school education and is regularly pursuing a full-time course of study.</SPAN> \r\n<LI><SPAN dir=ltr>A parent, brother, sister, grandparent, or grandchild who was wholly or partially dependent on the deceased.</SPAN> </LI></UL>', NULL, NULL),
(127, '3.c.1.1', 'Quiz', '\r\n\r\n<p><b>Congratulations!<span style=\\"\\">&nbsp; </span>You\r\nhave completed Chapter 3.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>To review what you have learned, let?s try a few quick\r\nquestions. </b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n', NULL, NULL),
(128, '3.c.1.2', 'Quiz', '\r\n\r\n', NULL, NULL),
(129, '3.c.1.3', 'Quiz', '\r\n\r\n', NULL, NULL),
(130, '4', 'Chapter 4: Other Topics Under FECA', '\r\n<p >&nbsp;</p>\r\n\r\n<p>In this chapter we will examine other topics under FECA.</p>\r\n\r\n<p >&nbsp;</p>\r\n\r\n<ol type=\\"A\\">\r\n<li><a href=\\"page.php?pageid=131\\">Third Party Claims</a></li>\r\n<li><a href=\\"page.php?pageid=138\\">Transitional Work Assignments</a></li>\r\n<li><a href=\\"page.php?pageid=150\\">Telework-Alternative Worksites</a></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Click the Next button to continue.</p>', NULL, NULL),
(131, '4.a', 'Third Party Claims', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>A third party claim is defined as ?when an injury or death for which benefits are payable under the Federal Employees? Compensation Act (FECA) is caused under circumstances that create a legal liability upon some<SPAN>&nbsp; </SPAN>person or persons other than the United States Federal Government to pay damages.?<?xml:namespace prefix = o /><o:p></o:p></P>', NULL, NULL),
(132, '4.a.1', 'Instructions Regarding  a Third Party Claim', '<P><SPAN dir=ltr></SPAN>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Review the accident report submitted by the employee.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Make sure third party liability information is given on the back of the CA-1 form.&nbsp; Call OWCP?s attention to the potential liability in the cover letter that forwards the claim.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Obtain the incident, accident or police report (if one is available) for all vehicle accidents or assault cases and all investigation reports regarding third party liability, and send to OWCP with the claim.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Interview the injured employee for details about the accident.</SPAN> </LI></UL>', NULL, NULL),
(133, '4.a.2', 'Instructions Regarding  a Third Party Claim', '<P><SPAN dir=ltr></SPAN>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Interview any witnesses to the injury.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Research any relevant areas, such as equipment warranties or weather reports (if the injury resulted from a fall on icy surface), and document the results of your research.&nbsp; Be alert to instances where the court unit should quickly investigate the injury or cause of injury (e.g. fall on ice, walk not shoveled, etc.)&nbsp; Delay in investigating these instances until OWCP inquires may preclude recovery if the conditions that caused the accident cannot be verified.&nbsp; Get as many facts as you can to demonstrate that the third party is liable.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Injured employee should always contact OWCP Third Party Claims Examiner for instructions before settling with the liable party.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Monitor third party actions taken by OWCP.&nbsp; OWCP will send a letter to the claimant asking what action he or she has taken.&nbsp; If the court unit does not receive its copy, follow up with OWCP to determine the status of the third party action.</SPAN> </LI></UL>', NULL, NULL),
(134, '4.a.3', 'Explanation of a Third Party Statement of Recovery', '<p>&nbsp;</p>\r\n<p><b>Property Damage</b>:&nbsp; A reasonable amount for clothing or other personal\r\nbelongings damaged or destroyed in an accident may be deducted.<span style=\\"\\">&nbsp; </span>These amounts must be itemized.<span style=\\"\\">&nbsp; </span>If an automobile or vehicle is damaged or\r\ndestroyed, then more tangible evidence of such damage is required.<span style=\\"\\">&nbsp; </span>The year, make and model, and the Blue Book\r\nvalue of the vehicle should be furnished.<span style=\\"\\">&nbsp;\r\n</span>A copy of the repair bill will normally suffice as proof of damages if\r\nthe vehicle was not totally destroyed.</p>\r\n\r\n<p>&nbsp;</p>\r\n<p><a href=\\"#\\" onmouseover=\\"getObj(''r1'').innerHTML = ''A reasonable attorney?s fee, but not more than the fee actually paid on the recovery balance.&nbsp; The fee must be expressed as a percentage.'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\">Attorney?s Fee:</a>&nbsp; <div id=\\"r1\\"></div></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\\"#\\" onmouseover=\\"getObj(''r2'').innerHTML = ''These consist of such items as filing fees, witness fees, actual costs of collection, or any payments for expert testimony as opposed to payment for treatment.'';\\" onmouseout=\\"getObj(''r2'').innerHTML = '''';\\">Court Costs (Litigation Expenses)</a>:&nbsp; <div id=\\"r2\\"></div></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\\"#\\" onmouseover=\\"getObj(''r3'').innerHTML = ''This amount is turned over to the employee and is not subject to any deductions.'';\\" onmouseout=\\"getObj(''r3'').innerHTML = '''';\\">20% Guarantee:</a>&nbsp; <div id=\\"r3\\"></div></p>', NULL, NULL),
(135, '4.a.4', 'Explanation of a Third Party Statement of Recovery', '<p>&nbsp;</p>\r\n\r\n\r\n<p><a href=\\"#\\" onMouseOver=\\"getObj(''r1'').innerHTML = ''This consists of any un-reimbursed allowable medical expenses paid by the employee.&nbsp; All medical expenses must be approved by OWCP.&nbsp; All items submitted for credit and deduction must be itemized and accompanied by copies of paid bills.'';\\" onmouseout=\\"getObj(''r1'').innerHTML = '''';\\">Medical Expenses Paid Direct: </a></p>\r\n<p><div id=\\"r1\\"></div></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\\"#\\" onMouseOver=\\"getObj(''r2'').innerHTML = ''All amounts paid by OWCP less the gross amount of any prior refunds made.'';\\" onmouseout=\\"getObj(''r2'').innerHTML = '''';\\">OWCP Disbursements:&nbsp; </a></p>\r\n<p><div id=\\"r2\\"></div></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\\"#\\" onMouseOver=\\"getObj(''r3'').innerHTML = ''This represents the amount to be refunded to the Government for OWCP disbursements.'';\\" onmouseout=\\"getObj(''r3'').innerHTML = '''';\\">Refund: </a></p>\r\n<p><div id=\\"r3\\"></div></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\\"#\\" onMouseOver=\\"getObj(''r4'').innerHTML = ''The surplus is retained by employee and offsets future compensation on account of the same injury.&nbsp; The employee will not be entitled to further payments until eligible for additional compensation (pay and medical expenses) in an amount greater than the surplus.'';\\" onmouseout=\\"getObj(''r4'').innerHTML = '''';\\">Surplus: </a></p>\r\n<p><div id=\\"r4\\"></div></p>\r\n', NULL, NULL),
(136, '4.a.5', 'Points to Remember  Regarding a Third Party Claim', '<P><SPAN dir=ltr></SPAN>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Third party means that an injury is caused by a person or object under circumstances which indicate there is a legal liability on a party other than the U.S. Government to pay the damages.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Third party claims include claims against an individual, company, or a manufacturer.</SPAN> </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Information regarding a possible 3rd party claim should be included at the time the employee files his or her claim for injury/occupational disease.&nbsp; The information should include the name and address of the 3rd party (person or manufacturer).</SPAN> </LI></UL>', NULL, NULL),
(137, '4.a.6', 'Points to Remember  Regarding a Third Party Claim', '<P><SPAN dir=ltr></SPAN>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>While a claim is pending against the third party, OWCP will provide medical and compensation benefits authorized by the FECA.&nbsp; In the event of recovery from the third party, the beneficiary (employee or his/her beneficiary) must first pay outstanding legal fees and costs, and then may retain 20 percent of the amount remaining.&nbsp; Generally, the beneficiary must then refund the full amount, or as much as possible, of the medical and compensation payments made at the time of the settlement.&nbsp; Any money remaining may be retained by the beneficiary but is credited against possible future expenses by OWCP.</SPAN></LI></UL>\r\n<P><SPAN dir=ltr></SPAN>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Refusal on the part of a beneficiary to assign his or her right of action to the </SPAN>United States or to prosecute an action in his or her own name when required to do so pursuant to CFR 10.501, shall deprive the beneficiary of all right to benefits under the Act. </LI></UL>\r\n<P>&nbsp;</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Samples of third party claims:</SPAN> \r\n<UL>\r\n<LI><SPAN dir=ltr>Automobile Accidents.</SPAN> \r\n<LI><SPAN dir=ltr>Defective equipment for which the manufacturer may be responsible.</SPAN> \r\n<LI><SPAN dir=ltr>Premise liability, where an accident may be caused by the negligence of a property owner.</SPAN> \r\n<LI><SPAN dir=ltr>Dog or animal bites.</SPAN> </LI></UL></LI></UL>', NULL, NULL),
(138, '4.b', 'Transitional Work Assignments (TWAs)', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>Without a return-to-work program the court unit would have to wait until the injured employee fully recovers before they can return to work.<SPAN>&nbsp; </SPAN>In some situations full recovery from a traumatic injury may take many months or even years.<SPAN>&nbsp; </SPAN>Providing transitional work assignments for all injured employees enables partially disabled employees to return to productive employment which often aids in their recovery.</P>', NULL, NULL),
(139, '4.b.1', 'Transitional Work Assignments (TWAs) continued', '<P class=MsoBodyText>&nbsp;</P>\r\n<P class=MsoBodyText>Returning a recuperating employee to the work environment facilitates the healing process.<SPAN>&nbsp; </SPAN>While the employee?s condition may temporarily prevent the performance of his or her normal duties, there are almost always opportunities for the employee to be useful in other ways.<SPAN>&nbsp; </SPAN>For short-term case management, the employee will participate in a Transitional Work Assignment (TWA).<SPAN>&nbsp; </SPAN>This is a temporary work assignment that accommodates the employee?s injury and or medical limitations.<SPAN>&nbsp; </SPAN>The circumstances surrounding the injury and the severity of the injury will determine whether it is practical for the injured employee to participate in a TWA.<SPAN>&nbsp; </SPAN>If the injury is minor and a few days of rest and medication is the prescribed course of treatment, there is no need for the employee to participate in a TWA.<SPAN>&nbsp; </SPAN>However, for those injuries in which the medical evidence demonstrates that the employee is partially disabled and will be out of work for several weeks or months, participation in the TWA program is warranted.</P>', NULL, NULL),
(140, '4.b.2', 'Steps in Return to Work', '<p>&nbsp;</p>\r\n<p class=\\"MsoNormal\\"><b style=\\"\\">Steps in Return to\r\nWork<o:p></o:p></b></p>\r\n\r\n<p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p></p>\r\n<ol type=''1''>\r\n<li><a href=''page.php?pageid=141''>Maintain Regular Contact with Injured/Ill Employees</a></li>\r\n<li><a href=''page.php?pageid=142''>Develop a Pre-Identified Pool of Temporary Duties</a></li>\r\n<li><a href=''page.php?pageid=143''>Obtain Probative Medical Documentation</a></li>\r\n<li><a href=''page.php?pageid=144''>Share Medical Documentation with Key Players</a></li>\r\n<li><a href=''page.php?pageid=145''>Plan the Employee?s Return to Work</a></li>\r\n<li><a href=''page.php?pageid=146''>Develop Temporary Alternate Duties: Transitional Work Assignments (TWAs)</a></li>\r\n<li><a href=''page.php?pageid=147''>Make the Return to Work Offer</a></li>\r\n<li><a href=''page.php?pageid=148''>Response to Offer</a></li>\r\n<li><a href=''page.php?pageid=149''>Return to Full Duty</a></li>\r\n</ol>', NULL, NULL),
(141, '4.b.2.1', 'Steps in Return to Work', '<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">&nbsp;</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">1. Maintain Regular Contact with Injured/Ill Employees</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\"><B><SPAN style=\\"FONT-SIZE: 14pt\\"><?xml:namespace prefix = o /><o:p></o:p></SPAN></B>&nbsp;</P>\r\n<P class=MsoNormal>Contact your disabled employee on a regular basis (weekly or bi-weekly, depending on the circumstances of the case).<SPAN>&nbsp; </SPAN>Employees need to know that they are valued employees of the court unit while they recover and are expected to return to work as soon as possible.<SPAN>&nbsp; </SPAN>We should check on their condition and inquire if we can provide any assistance in their recovery.<SPAN>&nbsp; </SPAN>Advise the employee that we are willing to accommodate them in any way that their physician states is medically necessary and request frequent updated medical documentation.<SPAN>&nbsp; </SPAN>It is the employee?s responsibility to maintain contact with the court unit during their recovery.<SPAN>&nbsp; </SPAN>The regular contact is one of the most important steps you can take to help your injured/ill employees expedite their recovery and return to work.<o:p></o:p></P>', NULL, NULL),
(142, '4.b.2.2', 'Steps in Return to Work', '<P>&nbsp;</P>\r\n<P>2. Develop a Pre-Identified Pool of Temporary Duties</P>\r\n<P>&nbsp;</P>\r\n<P>It is beneficial to already have a number of pre-identified alternate work tasks available throughout your court unit for injured workers.<SPAN>&nbsp; </SPAN>You might want to develop a set of 6 to 8 return-to-work task options or projects within the court unit that can be accomplished by injured workers.<SPAN>&nbsp; </SPAN>Identify the tasks and classify them by importance, required skills, physical demands, availability and duration (on-going, periodic, or one-time only).</P>', NULL, NULL),
(143, '4.b.2.3', 'Steps in Return to Work', '<P>&nbsp;</P>\r\n<P>3. Obtain Probative Medical Documentation</P>\r\n<P><BR>The employee?s supervisor and the coordinator/specialist are entitled to obtain detailed medical documentation of the employee?s current condition for the purpose of returning the employee to work.&nbsp; This may require contacting the claims examiner or the treating physician in writing.&nbsp; Form CA-17 may be sent to the physician at any time to determine an employee?s work capacity.&nbsp; You should plan on sending this form to the attending physician regularly.&nbsp;&nbsp; The medical documentation should include:</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>Diagnosis of the injury</SPAN> \r\n<LI><SPAN dir=ltr>Current course of treatment (physical rehabilitation, medications, number of office visits, etc.)</SPAN> \r\n<LI><SPAN dir=ltr>Prognosis for recovery (when the employee is expected to recover)</SPAN> \r\n<LI><SPAN dir=ltr>Current work capabilities</SPAN> </LI></UL>', NULL, NULL),
(144, '4.b.2.4', 'Steps in Return to Work', '<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">&nbsp;</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">4. Share Medical Documentation with Key Players</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\"><U><?xml:namespace prefix = o /><o:p></o:p></U>&nbsp;</P>\r\n<P class=MsoNormal>Provide current medical documentation to the Benefits Coordinator, Workers? Compensation Program Manager, if necessary.<SPAN>&nbsp; </SPAN>Keep in mind that all records are protected under the provisions of the Privacy Act and should be handled and shared accordingly.<o:p></o:p></P>', NULL, NULL),
(145, '4.b.2.5', 'Steps in Return to Work', '<P>&nbsp;</P>\r\n<P>5. Plan the Employee?s Return to Work</P>\r\n<P>&nbsp;</P>\r\n<P>In consultation with the Workers? Compensation Program Manager, Staffing Specialist, OWCP Nurse or Claims Examiner, one should review the current medical information and develop a plan of action for assisting the employee back to work as soon as possible.<SPAN>&nbsp; </SPAN>This may include creating temporary alternate or transitional work duties that match the employee?s current work capabilities until the employee is fully recovered and able to resume full duties.<SPAN>&nbsp; </SPAN>The court unit can plan an employee?s return to work as soon as we have medical documentation that indicates the person can work.<o:p></o:p></P>', NULL, NULL),
(146, '4.b.2.6', 'Steps in Return to Work', '<P>&nbsp;</P>\r\n<P>6. Develop Temporary Alternate Duties: Transitional Work Assignments (TWAs)</P>\r\n<P><U></U><BR>If an employee is unable to return to regular work, first look at the regular work setting for the possibility of a temporary modification for a few weeks/months.</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>What?s not getting done in your work area?</SPAN> \r\n<LI><SPAN dir=ltr>What special projects are currently on your ?To Do? list?</SPAN> \r\n<LI><SPAN dir=ltr>What administrative functions of your job could be delegated to an injured employee?</SPAN> \r\n<LI><SPAN dir=ltr>Are there production or administration areas that need straightening, organization, sorting, and or labeling?</SPAN> </LI></UL>', NULL, NULL),
(147, '4.b.2.7', 'Steps in Return to Work', '<P>&nbsp;</P>\r\n<P>7. Make the Return to Work Offer&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </P>\r\n<P><BR>&nbsp;In collaboration with the Workers? Compensation Program Manager, contact the employee with the offer about returning to work.&nbsp; The offer should be in writing (sent by certified mail) and should describe:</P>\r\n<UL>\r\n<LI><SPAN dir=ltr>The proposed job duties</SPAN> \r\n<LI><SPAN dir=ltr>The physical requirements of the job</SPAN> \r\n<LI><SPAN dir=ltr>The location of the job</SPAN> \r\n<LI><SPAN dir=ltr>The date the job is available</SPAN> \r\n<LI><SPAN dir=ltr>The date by which a response to the offer is necessary</SPAN> \r\n<LI><SPAN dir=ltr>The pay rate or salary of the job offered </SPAN>\r\n<LI><SPAN dir=ltr>The work schedule</SPAN> </LI></UL>\r\n<P>Send a copy of the letter to the OWCP claims examiner and document all actions taken.</P>', NULL, NULL),
(148, '4.b.2.8', 'Steps in Return to Work', '<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">&nbsp;</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">8. Response to Offer</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\"><?xml:namespace prefix = o /><o:p></o:p>&nbsp;</P>\r\n<P class=MsoNormal>The employee is required to accept any reasonable offer of limited duty/transitional work assignment.<SPAN>&nbsp; </SPAN>You must notify the OWCP claims examiner so that wage loss compensation benefits can be terminated or reduced.<SPAN>&nbsp; </SPAN>If the employee refuses to accept the work offered, any COP being received should be terminated as of the date the employee refused the offer, or after five workdays from the date of the offer, whichever is earlier.<SPAN>&nbsp; </SPAN>OWCP will then determine any continued entitlement to compensation based on the medical reports and the job offered to the employee.<o:p></o:p></P>', NULL, NULL),
(149, '4.b.2.9', 'Steps in Return to Work', '<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">&nbsp;</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\">9. Return to Full Duty</P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 0.5in; TEXT-INDENT: -0.5in\\"><?xml:namespace prefix = o /><o:p></o:p>&nbsp;</P>\r\n<P class=MsoNormal>After the period of limited duty outlined by the physician expires, the employee should return to full duty.<SPAN>&nbsp; </SPAN>The medical documentation must state in a detailed narrative report the diagnosis, prognosis, and approximate date the employee can resume full duty work.<SPAN>&nbsp; </SPAN>If the injury prevents the employee from returning to full duty, the employee may be reassigned to another position at the same grade and pay or to a lower grade position and lower salary.<o:p></o:p></P>', NULL, NULL),
(150, '4.c', 'Telework-Alternative Worksites', '<P class=MsoNormal>&nbsp;</P>\r\n<P class=MsoNormal>Employees who are directly engaged in performing the duties of their jobs are covered by the FECA, regardless of whether the work is performed at the court unit building or at an alternative worksite.<SPAN>&nbsp; </SPAN>However, when an employee is on property under his or her own control, activities which are not immediately directed toward the actual performance of regular duties do not arise out of employment.<SPAN>&nbsp; </SPAN>An employee who works at a desk at home removes himself or herself from the performance of regular duties as soon as he or she walks away from that desk to use the bathroom, get a cup of coffee, or seek fresh air.<SPAN>&nbsp;&nbsp; </SPAN><?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal>The ?Personal Comfort Doctrine? does not apply, and coverage cannot be extended for injuries which result from such activities.<SPAN>&nbsp; </SPAN><o:p></o:p></P>\r\n\r\n', NULL, NULL),
(151, '4.c.1', 'Telework-Alternative Worksites', '<P>&nbsp;</P>\r\n<OL>\r\n<LI><SPAN dir=ltr>If an employee confined to a wheelchair was injured when he reached to answer the telephone while working at home, the employee was eligible for workers? compensation benefits because he was required to answer the telephone as part of his official duties.</SPAN> \r\n<LI><SPAN dir=ltr>If an employee was injured while walking downstairs at home to check her furnace, malfunctioning, the employee is not eligible for workers'' compensation benefits. Maintenance of the furnace was not a requirement of her official duties.&nbsp; Once she left her immediate work area, she removed herself from coverage under the FECA.</SPAN> </LI>\r\n<LI><SPAN dir=ltr>The Clerk of the Court may allow an employee who is recuperating from an illness to perform work at home. If the illness has resulted from a work-related injury, the work performed at home may be a transitional work assignment or light duty job.&nbsp; The effect on workers? compensation benefits of returning to work at home is no different from that of returning to any other transitional work or light duty job.&nbsp; The employee is entitled to compensation for loss of wages resulting from a compensable injury.</SPAN> </LI>\r\n<LI><SPAN dir=ltr>If an employee cannot continue to work at home because of injury-related residuals, he or she is entitled to compensation.&nbsp; This situation is no different from that of an employee who attempts to return to light duty at the court unit building.</SPAN> </LI></OL>', NULL, NULL),
(152, '4.c.2', 'Quiz', '\r\n\r\n<p><b>To review what you have learned, let?s try a few quick\r\nquestions. </b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n', NULL, NULL),
